INSERT INTO `t_quantifier` VALUES ('1541713622208073729', '重要论述', '两个至上', '人民至上、生命至上', '习近平总书记', '各单位', 1, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:32', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622270988290', '重要论述', '三个必须', '1.管行业必须管安全\n2.管业务必须管安全\n3.管生产经营必须管安全', '习近平总书记', '各单位', 2, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:32', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622338097153', '安全生产', '双重预防机制', '1.安全风险分级管控\n2.隐患排查治理', '国务院安委办', '各主管部门、\n各参建方', 3, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:32', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622338097154', '安全生产', '一线三排', '一线：坚守发展决不能以牺牲人的生命为代价这条不可逾越的红线。\n三排：事故隐患排查、排序、排除。', NULL, '各主管部门、\n各参建方', 4, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:32', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622463926273', '安全生产', '硬六条', '1.对在粤建设项目开展全覆盖安全检查。\n2.严格落实施工前“六不施工”。\n3.严控施工现场作业人数。\n4.追究事故前严重违法行为刑事责任。\n5.依法暂扣事故企业安全生产许可证。\n6.从严限制事故企业招投标资格。', NULL, NULL, 5, 1, NULL, '1', '2022-06-28 17:22:26', 'superadmin', '超管', '2022-06-30 17:26:02', NULL, NULL);
INSERT INTO `t_quantifier` VALUES ('1541713622531035137', '危大工程', '六不施工', '1.未落实前期保障措施不施工。\n2.未编制专项施工方案、未按规定审批或论证方案、未按方案落实有关措施不施工。\n3.未进行安全技术交底不施工。\n4.未进行现场监督不施工。\n5.未进行第三方监测不施工。\n6.未经验收合格不施工。', NULL, '各参建方', 6, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622531035138', '事故处理', '四不放过', '1.事故原因未查清不放过\n2.责任人员未处理不放过\n3.责任人和群众未受教育不放过\n4.整改措施未落实不放过', NULL, '各主管部门', 7, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622598144002', '事故处理', '三个必须', '1.必须进行一次大反思大讨论的警示教育\n2.必须开展一次安全风险隐患大排查大整治\n3.必须主动向监管部门报告事故整改情况', NULL, '事故责任单位', 8, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622661058561', '事故处理', '七个立即', '1.立即对事故企业的主要负责人约谈、通报；\n2.立即启动“一盘棋”应急相应机制；\n3.立即实施安全风险预判预警机制；\n4.立即开展安全生产专项监管执法检查；\n5.立即开展典型安全生产事故警示教育；\n6.立即对事故企业主要负责人进行培训；\n7.立即开展重点行业领域安全专项整治。', NULL, '事故责任单位', 9, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622728167426', '事故处理', '双查', '既要倒查追究当事人的责任，\n也要倒查追究相关领导的责任。', NULL, '各主管部门', 10, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622795276290', '执法检查', '四严措施', '严防、严管、严查、严处', NULL, '各主管部门', 11, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622795276291', '复工复产', '三个一', '1.要广泛开展一次安全生产培训。\n2.要全面进行一次设备安全检查。\n3.要认真制定一套复产方案。', NULL, NULL, 12, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622862385153', '复工复产', '六个一', '1.召开一次领导班子安全生产专题会议\n2.制定一份周密的复工复产方案\n3.召开一次全体员工大会\n4.开展一次全员安全教育\n5.制定一套应急处置方案\n6.开展一次全厂性安全检查', NULL, '各参建方', 13, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622929494018', '应急机制、重大假期值守', '五个一', '1.每日一会商（研判）\n2.每日一调度\n3.每日一检查\n4.每事一处置\n5.每日一报告', NULL, '各主管部门', 14, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713622992408577', '应急机制、重大假期值守', '三三制', '三分之一在岗 在位、三分之一备勤、三分之一轮休', NULL, '各主管部门', 15, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623055323137', '事故防范', '四令三制', '四令：动火令、动工令、复工令、停工令；\n三制：有限空间作业票制、值班室（中控室）24小时值班制、领导带班值班制；', NULL, '各参建方', 16, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623055323138', '高处作业', '五个必须', '1.必须培训持证上岗\n2.必须实行作业审批\n3.必须做好个人防护\n4.必须落实工程措施\n5.必须安排专人监护', NULL, '各参建方', 17, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623122432001', '高处作业', '六不施工', '1.未进行安全教育交底不施工\n2.为落实高处作业管理不施工\n3.安全防护用品无保障不施工\n4.不编制实施专项施工方案不施工\n5.安全防护不到位不施工\n（与危大工程应急部门六不施工类似）', NULL, '各参建方', 18, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623189540865', '消防安全', '七个一', '1.开展一次消防安全自查；\n2.组织一次消防安全培训；\n3.对消防设施进行一次维护保养；\n4.对电气线路进行一次安全检查；\n5.组织一次初起火灾扑救和应急疏散演练。\n6.对消防安全管理制度进行一次清理。\n7.作出一次消防安全承诺。', NULL, '各生产经营\n单位', 19, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623252455426', '有限空间', '七不准', '1.未经风险辨识不准作业。\n2.未经通风和检测合格不准作业。\n3.不佩戴劳动防护用品不准作业。\n4.没有监护不准作业。\n5.电气设备不符合规定不准作业。\n6.未经审批不准作业。\n7.未经培训演练不准作业。', NULL, NULL, 20, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623315369986', '建筑施工', '六不施工', '1.未落实前期保障措施不施工。\n2.未编制专项施工方案、未按规定审批或论证方案、未按方案落实有关措施不施工。\n3.未进行安全技术交底不施工。\n4.未进行现场监督不施工。\n5.未进行第三方监测不施工。\n6.未经验收合格不施工。', NULL, '各参建方', 21, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623382478849', '2021年大检查', '3个100%', '存在重大危险源的企业100%检查、\n2020年以来被发现存在过重大安全隐患的企业100%检查、2020年以来被责令停产停业整顿过的企业100%检查', NULL, '各主管部门', 22, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:33', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623445393409', '动火作业', '三个一律', '动火前：\n一律不准进行交叉作业；\n一律清除现场可燃物质；\n一律检测可燃气体含量、保持良好通风；\n（严防交叉作业动火引发爆炸、火灾事故）', NULL, '各参建方', 23, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623445393410', '危大工程执法', '四个100%', '1.所有危大工程检查执法率100%\n2.发现的违法行为依法查处率100%\n3.发现的安全生产问题复查率100%\n4.各类安全生产违法违规行为举报案件核实查处率100%', NULL, '各主管部门', 24, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623508307969', '执法检查', '四个一律，五个一批', '四个一律：集中曝光一批重大事故隐患和严重违法违规行为，公布一批实施联合惩戒和“黑名单”管理企业，公告一批依法关闭取缔的违法违规和不符合安全生产条件的企业\n五个一批：依法严惩一批违法违规行为，彻底治理一批重大事故隐患，关闭取缔一批违法违规和不符合安全生产条件的企业，联合惩戒一批严重失信企业，问责曝光一批责任不落实、措施不力的单位和个人。', NULL, '各主管部门', 25, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623575416833', '涉水地下工程', '六项措施', '1.全面摸清水文地质情况\n2.强化专项施工方案管理\n3.加强隧道施工超前预报和监控量测\n4.全面排查施工方案落实情况\n5.有效提升应急救援处置能力\n6.严格施工现场作业人员管控', NULL, '各主管部门、\n各参建方', 26, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623642525698', '涉水地下工程', '六不施工', '1、未探明水文地 质情况的不得施工；\n2、未编制并执行危大工程专项施工方案的不得施工；\n3、未对涉水在建地下工程开展超前地质钻探的不得施工；\n4、未监控施工过程深层土体变形、地下水等关键指标的不得施工；\n5、未在隧道联络通道设置应急防淹门的不得施工；\n6、未制定防透水防坍塌专项应急预案并开展演练的不得施工。', NULL, '各参建方', 27, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623705440258', '安全管理', '四严措施', '严防、严管、严查、严处', NULL, '各主管部门', 28, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623705440259', '风险管控/隐患整治', '四早/五到位', '早发现、早研判、早预警、早控制。\n/整改措施、责任、资金、时限和预案到位。', NULL, '各参建方', 29, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623768354818', '深基坑、高边坡', '三项措施', '1.执行地质灾害隐患排查；\n2.施工现场风险管控；\n3.安全监测处置。', NULL, '各参建方', 30, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623835463682', '深基坑、高边坡', '三项制度', '1.遵守安全评估；\n2.专项施工方案评审；\n3.应急预案处置。', NULL, '各参建方', 31, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623902572546', '建筑起重机械', '十个不准', '（一）不准施工总承包单位将安装拆卸（含附着、加节顶升，下同）作业委托给不具有相应施工专业承包资质或没有安全生产许可证的单位实施。\n（二）未重新签订建筑起重机械安装拆卸（应包含附着、加节顶升作业内容）合同的，不准施工总承包单位擅自变更原安装拆卸单位。\n（三）不准施工总承包单位未考虑作业条件实际，擅自强令安装拆卸单位违规作业，或擅自强令安装拆卸单位不按审批通过的安装拆卸专项方案实施。等等', NULL, '各参建方', 32, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623965487105', '质量安全', '十不准', '质量：                    安全：\n1.现场人员管理            1.管理职责明确\n2.重大设计变更            2.安全条件达标\n3.重要材料检验            3.管理机构配置\n4.工程质量检测            4.教育培训管理\n5.分部验收管理            5.隐患排查整治\n6.检测机构管理            6.危大工程管理\n7.建材设备使用            7.基坑支护管理\n8.工程竣工验收            8.起重机械管理\n9.工程质量保修            9.模板（脚手架）管理\n10.质量事故处理           10.安全事故处理', NULL, '各参建方', 33, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713623965487106', '防疫', '六个100%', '1.100%实名扫码（亮码）登记\n2.100%核查人员行程\n3.100%查验核酸检测结果\n4.100%接种新冠疫苗\n5.100%做好“双报告”\n6.100%落实应急值守', NULL, '各参建方', 34, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624028401666', '防疫', '六个落实', '1.落实工地封闭管理和人员登记台账\n2.是落实储备口罩、消毒液等防控物资\n3.落实宿舍、食堂等人员密集场所通风消毒\n4.落实保安、厨师、采购、保洁等重点岗位人员每周开展核 酸检测\n5.落实参建人员疫苗接种“应种尽种”\n6.落实新进工地人员和返岗工人员提供 48 小时核酸检测阴 性证明\n（“工地疫情防控六个落实”作为节后复 工复产必要条件，“六个落实”不到位的，一律不得复工复产）', NULL, NULL, 35, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624095510530', '安全教育', '三个一', '1.每天开工前组织不少于一刻钟的作业人员安全教育\n2.每周组织作业人员开展一次安全生产小结\n3.每月组织项目安全管理人员汇报一次安全责任履职情况', NULL, NULL, 36, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624162619394', '安全生产', '一点三员', '一点：一个工点\n三员：安全员、技术员、班组长', '中交佛投', '市二号线施工单位', 37, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624225533953', '防疫', '四方责任', '属地、部门、单位、个人', '卫健部门', '/', 38, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624288448513', '来佛返佛人员健康管理', '四个一', '1.发放一份健康告知书，\n2.开展一次健康问询，\n3.查验一次健康码，\n4.开展一次核酸检测。', '卫健部门', '/', 39, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624355557378', '来佛返佛人员健康管理', '六个落实', '一是落实工地封闭管理和人员登记台账；\n二是落实储备口罩、消毒液等防控物资；\n三是落实宿舍、食堂等人员密集场所通风消毒；\n四是落实保安、厨师、采购、保洁等重点岗位人员每周开展核酸检测；\n五是落实参建人员疫苗接种“应种尽种”；\n六是落实新进工地人员和返岗工人员提供 48 小时核酸检测阴性证明', '卫健部门', '建设工地专班各成员单位、各区住房城乡和水利局、各有关单位', 40, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:34', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624355557379', '来佛返佛人员健康管理', '三不', '居家不外出、人员不来访、采样不出门', '卫健部门', '建设工地专班各成员单位、各区住房城乡和水利局、各有关单位', 41, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:35', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624418471937', '化工行业特殊作业', '四令三制', '四令：动火令、动工令、复工令、停工令；\n三制：有限空间作业票制、值班室24小时值班制、领导带班值班制；', NULL, '/', 42, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:35', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624485580801', '安全生产专项整治三年行动计划', '一图两清单', '一图：《重点任务推进路线图》；\n两清单：《安全生产专项整治三年行动发现的突出问题和重大隐患清单》、《安全生产专项整治三年行动制度措施清单》。', '安全生产专项整治三年行动计划', '各主管部门、生产经营单位', 43, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:35', '1539414415447072770', '123');
INSERT INTO `t_quantifier` VALUES ('1541713624548495362', '安全生产专项整治三年行动计划', '十个有', '有方案、有部署、有机构、有检查、有宣传、有路线图、有台账、有考核、有效果、有大事记。', '安全生产专项整治三年行动计划', '各主管部门、生产经营单位', 44, 0, NULL, NULL, '2022-06-28 17:22:26', 'superadmin', '超管', '2022-07-07 16:42:35', '1539414415447072770', '123');
