INSERT INTO `t_quantifier` VALUES ('1544959005969256449', '安全生产', '硬六条', '1.对在粤建设项目开展全覆盖安全检查。2.严格落实施工前“六不施工”。3.严控施工现场作业人数。4.追究事故前严重违法行为刑事责任。5.依法暂扣事故企业安全生产许可证。6.从严限制事故企业招投标资格。', '', NULL, NULL, 0, NULL, NULL, '2022-07-07 16:18:26', '1539414415447072770', '123', '2022-07-30 17:26:43', '1544145698858913794', '普通用户');
