INSERT INTO `t_quantifier` VALUES ('1561892393552285698', '防台风', '六个百分百', '1.出海作业渔船100%回港；\r\n2.渔排人员100%上岸；\r\n3.回港船只100%落实防御措施；\r\n4.山区地质灾害高危区、滨海旅游度假区人员100%转移到安全地带；\r\n5.危破房、低洼地简易房、户外施工作业人员100%转移到安全地带；\r\n6.海上风电施工平台人员100%安全撤离。', '省防总', '各主管部门、 各参建方', NULL, 0, NULL, NULL, '2022-08-23 09:45:40', '1544145698858913794', '普通用户', '2022-08-23 11:16:37', '1544145698858913794', '普通用户');
INSERT INTO `t_quantifier` VALUES ('1561915069096366082', '防台风', '八个再查一遍', '1.对危险区域临险人员再彻查一遍；\n2.对海上船舶和海上作业人员上岸情况再彻查一遍；\n3.对景点、公园关闭和人员撤离情况再彻查一遍；\n4.对临海小区防御工作情况再彻查一遍；\n5.对水利工程再彻查一遍；\n6.对在管在建工程设施设备加固和人员撤离情况再彻查一遍；\n7.对城乡易涝点再彻查一遍；\n8.对地质灾害隐患点再彻查一遍；', '省防总', '各主管部门、 各参建方', NULL, 0, NULL, NULL, '2022-08-23 11:15:46', '1544145698858913794', '普通用户', NULL, NULL, NULL);
