INSERT INTO `t_section_menu` VALUES ('1555104036637741057', '三号线工程', '1', '0', '', '（截止2022年7月底，由服务2标每月更新）\n一、项目总体情况\n  佛山市城市轨道交通三号线南起顺德客运港站，北至科技学院站，为贯通佛山市南北的主干线，线路全长约为69.5公里，总投资425.72亿元。三号线共设37座车站（有4个车站已纳入其它线路同步实施)，高架车站3座，地下车站34座，全线设置1段2场，4座主变，1座控制中心。\n二、工程进展情况\n  1.土建工程部分：全线38个车站实现34个车站主体结构封顶、2座进入主体结构施工（叠滘、南海大学城站）、2座未招标（顺德港、佛山高铁站）；全线37个区间实现29个区间（含出入场线）双线洞通、剩余6个区间9台盾构机正在掘进施工（3个单线贯通），1个区间（南海大学城站至佛科院仙溪校区站）未开始掘进，1个区间（顺德港站至顺德学院站）未招标；全线159个车站出入口及风亭，已完成122个、18个正在施工、19个待开始；全线67个联络通道，51个已贯通、4个正在进行施工,12个待开始。\n  2.机电工程部分：全线38个车站，27个车站机电工程进场施工；1段2场中2个停车场机电施工基本完成，狮山车辆段总体施工完成约95%；4座主变电所中3个已完成送电并临时三权移交运营，剩余文昌主所正进行主体结构施工；正线区间强电、弱电、通信、信号、铺轨等系统工程工作面主要集中在首通段，且已基本完成。\n  3.三号线土建工程共有43 处危大工程，其中共8 个深基坑、6个盾构区间（9 台盾构机）、6 个暗挖工程（4 个暗挖联络通道、2 个暗挖区间）、5 处高支模、16 台起重设备、有限空间作业11 处（盾构9 处，暗挖2处）在进行施工作业。\n三、首通段（顺德学院站～镇安站）工作推进情况\n  1.三号线首通段开通范围为顺德学院站～镇安站，包含22座车站、逢沙停车场、北滘停车场、夏园主变电所、岳步主变电所，正线开通里程约40.72公里。\n  2.工程建设情况\n  2.1.土建工程部分：首通段区间全部贯通；22个车站主体结构全部完成，95个车站出入口及风亭已完成92个、剩余3个均在施工中；联络通道已全部完成施工。\n  2.2.机电工程部分：首通段已完成轨通、电通，除三北和北高区间外，热滑已完成；22个车站装修完成率超94%，11个车站已基本施工完成并临时三权移交运营；夏园主变电所、岳步主变电所已完成送电并临时三权移交运营；逢沙停车场施工进入收尾阶段，热滑完成、17列电客车接入，北滘停车场施工进入收尾阶段，热滑完成、5列电客车接入；31辆电列车中27列出厂验收完成、22列电客车到位、16列动调完成。\n  3.工程质量验收、专项验收工作情况\n  首通段共计单位（子单位）工程128个，截止2022年7月8日，已完成68个正式验收，13个预验收。其中土建共计62个，累计通过正式验收52个，通过预验收0个；机电共计66个，累计通过正式验收16个，通过预验收13个。其他12个专项验收工作，除建设用地规划许可证和工程规划验收受影响外，其余专项验收工作均正常推进。\n四、后通段（镇安站～佛科院仙溪校区站）建设管理情况\n  三号线后通段15座车站除叠滘站及南海大学城站外均已封顶，正在开展内部结构及出入口附属结构施工，5座车站已移交站后机电施工；14个区间已双线贯通7个、单线贯通3个，剩余9台盾构正在掘进，掘进比例平均67%；2个区间已完成短轨通。狮山车辆段生产维修楼已完成，运用库完成91%，检修库完成91%。博爱路主变电所已投产送电，文昌主变电所完成主楼桩基施工。\n\n\n\n\n\n', '3', NULL, NULL, '9', 3, 1, NULL, '1', '2022-08-04 16:11:09', 'superadmin', '超管', '2022-08-16 17:31:25', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555104186227593218', '四号线工程', '1', '0', NULL, '（截止2022年7月底，由服务2标每月更新）\n一、项目总体情况\n  佛山市城市轨道交通四号线一期西起三水区北江大道站，东至南海区港口路站，全长55.22km，其中地下段49.14km，过渡段0.82km，高架段5.26km。共设33座车站（地下站30座、高架站3座），其中换乘站14座，平均站间距约1.71km。设平胜车辆段和大堕山停车场、湾华控制中心，设三水主变、绿岛湖主变和平洲主变。最高运行速度为100km/h 。\n二、工程进展情况\n  目前四号线一期工程进场共4 个标段、共6 个车站，4 个车站进行交通疏解、围蔽区域内绿化迁改、管线迁改、地质勘探工作、交通导改及临时围蔽等施工准备工作，2 个车站进行围护结构钻孔桩施工。本月对佛山地铁四号线一期工程4 个标段报监资料进行了审核。\n', '3', NULL, NULL, '9', 4, 1, NULL, '1', '2022-08-04 16:11:45', 'superadmin', '超管', '2022-08-15 17:22:07', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555104291169079297', '城市轨道运营线路基本情况', '1', '0', NULL, '  目前我市运营的城市轨道交通线路共5条，分别为地铁广佛线、地铁2号线一期、广州地铁7号线一期西延顺德段、南海区新型公共交通首通段及高明区有轨电车示范线首通段，佛山境内运营里程81.7km（其中地铁65.6km、有轨电车16.1km）。', '3', NULL, NULL, '9', 2, 1, NULL, '1', '2022-08-04 16:12:10', 'superadmin', '超管', '2022-08-15 11:16:50', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555104380113489922', '工程质量验收情况', '1', '0', NULL, '（截止2022年7月底，服务2标负责每周更新一次）\n  1.检查4个城市轨道项目（地铁2号线一期甩项工程、地铁三号线、地铁四号线一期工程、南海新交通）21个标段，4个铁路项目（南海一汽大众铁路专用线工程、广湛高铁、广州南沙港铁路和珠肇高铁）7个标段。\n  2.累计组织检查38次、出动检查人员185人次，下发工程质量安全整改通知书11份、内部形成监督检查记录38份，查出质量安全问题共计130条，其中安全问题56条、质量问题4条、管理行为问题70条，重大事故隐患2个。截止7月31日，应提交整改回复资料8份，提交整改闭合资料共8份，回复率100%。形成违规行为扣分记录5次（地铁三号线2次、地铁四号线一期工程3次）。\n 3. 对在建轨道交通工程项目6个标段进行原材料、（半）成品抽检，共抽检16种（类）、42组，已出结果22组，合格22组，合格率为100%；对3个标段进行工程实体检测，共检测5项参数、18个数据，合格18个，合格率为100%。其中，对三号线工程3206-3标进行隧道衬砌外观及错台检测，共检测600环，发现病害26处，下发监督检测通知单1份。\n', '6', 30, '2022-09-14 17:23:47', '9', 5, 1, NULL, '1', '2022-08-04 16:12:31', 'superadmin', '超管', '2022-08-15 17:23:47', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555104547495579649', '里水有轨电车工程', '1', '0', '', '（截止2022年7月底，服务2标负责每月更新一次）\n一、项目总体情况\n  南海区有轨电车里水示范段项目投资估算总额为21.864亿元，线路始于规划的里湖新城中轴线里湖新城站，线路沿环镇北路、草场工业大道、里广路敷设，止于里横路站，全长9.834公里,其中地面段7.063公里，地下段1.24公里，高架段1.531公里。全线共设车站13座，其中地下站1座（里官路站），换乘站2座，在岗美站与佛山地铁8号线换乘，在里横路站与广州地铁12号线换乘。车辆基地1座，占地面积约102亩。\n二、工程进展情况（截止2022年7月31日，由服务2标每月更新一次）\n  项目总共分为三个标段，已于2021年3月开始进场施工。一标主要进行下穿隧道围护结构、基坑土方开挖，地基加固、路基填筑、里水涌、梅涌桥梁主体结构等施工。二标主要进行路基地基加固，路基填筑、佛山一环跨线桥桩基、墩身结构、车辆基地综合楼结构等施工。三标主要进行跨水口水道大桥主体结构施工、草场工业大道旧路与厂房间场地的地基处理、排水管道施工。\n', '3', NULL, NULL, '9', 8, 1, NULL, '1', '2022-08-04 16:13:11', 'superadmin', '超管', '2022-08-15 17:25:08', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555104696745693185', '南海新交通工程', '1', '0', NULL, '（截止2022年7月底，服务2标负责每月更新一次）\n一、项目总体情况\n  南海区新型公共交通系统试验段工程线路全长13.1km，概算总投资44.1亿元，其中地下线3.681km，高架线7.626km，地面线1.888km，过渡段0.280km,全线设15个站（地下站4座、地面站3座、高架站8座），投资44.1亿元。\n二、工程进展情况\n  南海区轨道交通工程在建项目共2 个，分别为南海新交通项目，施工标段共2 个、有轨电车里水示范段工，施工标段共3 个。南海新交通项目：首通段（雷岗站至三山新城北站共10 个站）已开通，后通段（三山新城南至林岳东站共5 个站）机电专业已于8 月1 日完成单位工程正式验收。\n', '3', NULL, NULL, '9', 9, 1, NULL, '1', '2022-08-04 16:13:47', 'superadmin', '超管', '2022-08-15 17:25:31', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555104791264333825', '南海一汽大众工程', '1', '0', NULL, '（截止2022年8月底，服务2标负责每月更新一次）\n一、项目总体情况\n  广东南海一汽大众铁路专用线概算总投资6.9亿元，采用设计施工总承包（EPC）模式实施建设。线路总长1.96km（铺轨长度10.56km）、无正线，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\n  截至目前已完成固投金额为 8300 万元，完成今年计划固\n投金额 18000 万元的 46.11%；累计完成施工产值约 3.90 亿元，占 EPC 合同价 4.98 亿元的 78.3%。\n 主要包括以下两项建设内容：\n  1.改造既有广珠铁路官窑站，增设到发线3条，预留1条；\n  2.在广珠铁路官窑站北侧新建综合性货场一处，设置3束5线货物线，另预留1条。\n  3.中标单位为中铁工程设计咨询集团有限公司；施工分包单位为中铁六局集团有限公司；监理单位为中铁一院集团南方工程咨询监理有限公司。\n二、工程进展情况\n  1.站场路基：站场核心区已基本完成填筑；\n  2.站场附属：站场排水沟、挡土墙、浆砌片石、站场坡脚\n排水槽等已基本完成；\n  3.跨官华路特大桥：正在进行桥面附属结构工程施工；\n  4.站场房建：综合楼、宿舍楼已完成封顶，正在进行装饰\n装修；\n  5.轨道工程：站场核心区新增 3 股到发线，以及货场区 3\n束 6 线已完成轨道铺设；\n  6.四电及设备工程：房建部分机电已开始施工，站场已完\n成部分电力线及通讯线管沟施工。\n\n \n', '3', NULL, NULL, '9', 10, 1, NULL, '1', '2022-08-04 16:14:09', 'superadmin', '超管', '2022-09-01 08:57:46', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555104895551508481', '总体情况', '1', '0', '1565619887820345345', '  目前我市在建城市轨道交通工程项目共4个，共139km：三号线工程69.5km、四号线一期工程56km、南海新交通工程3.6km、里水有轨电车9.9km。\n  佛山市境内在建省管铁路项目4个，共115.5Km：为一汽大众铁路专用线项目、广湛高铁、珠肇高铁、广州南沙港铁路。\n', '3', NULL, NULL, '9', 1, 1, NULL, '1', '2022-08-04 16:14:34', 'superadmin', '超管', '2022-09-02 16:39:12', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555104979999625218', '省管铁路', '1', '0', NULL, '（截止2022年7月底，服务2标负责每月更新一次）\n一、项目总体情况\n  佛山市省管铁路目前在建4个项目（7个施工标段）。广湛高铁（中铁二十五局GZZQ-2标、中铁广州局GZZQ-3标）、珠肇高铁（江机段中铁七局JJZQ-6标、高肇段中铁十五局GZZQ-1标）、南海一汽大众铁路专用线工程、南沙港铁路（中铁三局NSGZH7标和南沙港铁路中铁十一局NSGZQ-3标）。\n   1.广州至湛江铁路工程GZZQ-2标工程概况：广湛铁路位于广东省境内,线路自广州枢纽广州站引出,沿途经过广州、佛山、肇庆、云浮、阳江、茂名、湛江等市,终至规划湛江北站。我司负责的范围是广湛铁路站前二标工程,施工内容包括三部分:一是位于佛山市禅城区和南海区境内,长度10.448km(含街边站改和改建广茂线线路长度2.1km )的正线工程;二是位于佛山市三水区,连接广茂铁路与广珠铁路的新建广茂至广珠上、下行联络线工程,上下行长度分别为4.954km、4.779km:三是位于广州市白云区江高镇,线路长度3.627km的新建连接广珠铁路至京广三线的客车联络线工程。联络线计划开通日期2022年6月30日;正线计划施工总工期47.7个月,计划开工日期2020年1l月10日,竣工日期2024年10月30日。合同总造价19.3884亿元,其中:联络线及街边站改建工程9.8523亿元,正线工程9.5361亿元。\n   2.广州至湛江铁路工程GZZQ-3标工程概况：新建广州至湛江高速铁路站前工程GZZQ-3标段，里程范围DK34+675.57~DK50+328.089,线路长度15.652km,全部为桥梁段。线路位于佛山市南海区、三水区和高明区境内,线路起于佛山特大桥跨东平水道斜拉桥桥头DK34+675.57,上跨东平水道、国道G359、国道G240、广珠货运铁路、沈海高速公路和西江,终至标段终点佛山特大桥桥尾DK50+328.089。设特大桥1座,即佛山特大桥80#墩~湛方台段。下部结构共4006根桩基,423个墩台,上部结构包括双线简支预制梁356孔(24m双线简支梁42孔,32m双线简支梁311孔,非标简支梁3孔);特殊梁跨21处,其中常规连续梁18处,(67.5+60+60+350+60+60+67.5m)钢混混合结合梁斜拉桥1处,(109+200+200+109)m钢混混合连续刚构1处,96m简支拱1处。总工期:2020年11月10日-2024年10月31日。 \n 3.广珠广茂联络线：广珠广茂上、下行联络线于既有广珠铁路K35+800处新建三江口线路所以18#道岔引出，分别跨越二广高速公路和广海大道，下行线下穿广珠铁路后，分别于既有广茂铁路K45+850和K46+950处新建三水线路所以18#道岔接入。特大桥共2座，预制简支T梁161孔。设置特殊梁跨6 处，其中连续梁4处，钢桁梁1处，简支拱1处。\n  4.佛山市初步设计已批复范围内，佛山市境内包括正线工程和广茂至广珠上、下行联络线工程。正线起自佛山站（不含）大里程端DK24+300，出站沿既有广茂线通道向西，下钻佛开高速公路和禅西大道后，分别跨越佛罗路、佛清从高速公路、东平水道、沈海高速公路、广珠铁路和西江后，终至佛山特大桥桥尾DK50+328.089，全线沿途经过佛山市禅城区、南海区、三水区和高明区，线路长度26.102km，桥梁长度23.664km，桥隧比90.66%。其中：禅城区境内0.458km，均以路基形式通过。南海区境内19.937km，桥梁长度17.499km，桥隧比87.78%。三水区境内4.542km，均以桥梁形式通过。高明区境内1.165km，均以桥梁形式通过。\n二、工程进展情况\n  1.广珠广茂联络线上行线特大桥开累完成桩基础386根，完成总量428根的90.1%；承台58个，完成总量85个的68.2%；墩身50个，完成总量的58.8%。\n  2.广珠广茂联络线下行线特大桥开累完成桩基础375根，完成总量437根的85.8%；承台55个，完成总量91个的60.4%；墩身46个，完成总量的50.5%。\n  3.广珠广茂联络线上行线跨西江引水工程中桥开累完成桩基础12根，完成总量12根的100%；承台0个，完成总量2个的0%；台身0个，完成总量的0%。\n', '3', NULL, NULL, '9', 11, 1, NULL, '1', '2022-08-04 16:14:54', 'superadmin', '超管', '2022-08-16 17:43:18', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555105070609174530', '危大工程', '1', '0', NULL, '（截止2022年8月8日，服务1标负责每月更新一次）\n一、轨道交通工程\n  1.城市轨道交通工程:目前全市共5个项目在施工（56个施工标段）；共有39处危大工程，其中8个深基坑（三号线叠滘站、大学城站；其他出入口及风亭6个）；5个盾构区间（6台盾构机，其中2台泥水盾构机）；3个暗挖工程（1个暗挖联络通道正在进行积水泵房施工；2个暗挖区间：佛山西站配线段左、右线）；6处高支模（叠滘站、大科区间、大学城站、其它车站附属结构3处）；16台起重设备（塔吊2台、龙门吊11台、桥式起重机2台、履带吊1台）；有限空间作业9处（盾构6处，暗挖3处）。2022年8月份重大风险管控项目13个（全部在三号线，其中一级管控7个、二级管控6个)，数量比7月份减少3处，其中：一级风险管控减少1处（镇安站-桂城站区间盾构区间）；二级风险管控减少2处（佛山机场站附属结构、狮山站-大学城站区间联络通道）。\n二、省管铁路\n  1.省管铁路（佛山段）目前在建4个项目（7个施工标段），共有5处高风险工点均在广湛高铁 。\n  2.省管铁路8月份危大工程共31处，具体如下：\n  2.1.基坑工程4处：（珠肇高铁GZZQ-1标1处、珠肇高铁JJZQ-6标2处、广湛高铁GZZQ-3标1处）；\n  2.2.挂篮安装及移动工程8处：（广珠广茂联络线下行线跨广三高速公路55-58#墩（62+112+62）m连续梁2处、广珠广茂联络线上行线60-63#墩（32+46+32）m连续梁2处、广珠广茂联络线上行线69-72#墩（40+56+40）m连续梁2处、佛山特大桥连续梁193#墩2处）；\n  2.3.承重支撑体系2处：（广珠广茂联络线上行线96m钢桁梁1处、120m系杆拱桥1处）；\n  2.4.起重吊装及设备工程10处：（2台塔吊、8台履带吊）；\n  2.5.架桥机2台：(广珠广茂联络线上行线特大桥、下行线特大桥）：\n  2.6.水上作业工程2处：（跨东平水道桥水上栈桥及双壁钢围堰施工、跨西江桥水上栈桥及钢围堰施工）：\n  2.7.邻近营业线3段，存在影响铁路运营安全风险的路基施工：（广珠广茂联络线路基的共线段、上行线及下行线）。', '3', NULL, NULL, '9', 12, 1, NULL, '1', '2022-08-04 16:15:16', 'superadmin', '超管', '2022-08-16 17:37:08', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555105220358410242', '在建项目涉水工程', '1', '0', NULL, '  （截止2022年7月底，服务1标负责每月更新一次）\n佛山市轨道交通工程涉水工程共2处，均在广湛高铁（跨东平水道桥水上栈桥及双壁钢围堰施工、跨西江桥水上栈桥及钢围堰施工）。', '3', NULL, NULL, '9', 7, 1, NULL, '1', '2022-08-04 16:15:52', 'superadmin', '超管', '2022-08-15 17:24:46', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1555105365795901442', '重大风险情况', '1', '0', NULL, '（截止2022年7月底，服务1标负责每月更新一次）\n全市在建轨道交通工程目前在施工的共有18处重大风险：\n一、城市轨道交通8月份二级及以上风险管控措施的重大风险管控点共有13处，具体如下：                            \n  1.盾构掘进一级风险管控5处,分别是：\n  （1）南～叠区间（3205-2标中建四局）右线富水砂层/盾构在较长范围内叠线施工，两线隧道净间距2.4-3米（小净距施工），即将进入叠线加固段施工，加固段1000环开始；\n  （2）叠～中区间（3205-2标中建四局）右线富水砂层/穿越海天废弃厂房（桩基为素混凝土桩）/文沙大桥（钻孔灌注桩，与其水平净距约2.6m。）；\n  （3）中～火区间（3205-2标中建四局）右线富水砂层/下穿文昌大桥/火车站地下人防/综合批发市场7栋商铺（商铺为天然基础）；\n  （4）火～桂区间（3205-3标中建三局）左线富水砂层/车世界二期B、C栋（区间隧道与房屋桩基有冲突）；\n  （5）佛～罗区间（3205-3标中建三局）左线下穿军事输油管及营房/上跨广佛环区间隧道，右线即将接收。\n  2、车站、附属深基坑一级风险管控2个（均在3205-2标中建四局）：\n  （1）叠滘站东区深基坑及C出入口施工（富水砂层、管线保护和建筑物）；\n  （2）火车站附属结构A出入口顶板施工（富水砂层、近建筑物、燃气管/雨水箱涵迁改及保护）。    \n二、省管铁路（佛山段）目前在建4个项目（7个施工标段），共有5处高风险工点均在广湛高铁。\n  （1）GZZQ-2标中铁二十五局3处临近营业线的路基施工，存在影响铁路营业线运营行车安全等风险。\n  （2）GZZQ-3标中铁广州局2处深水基础施工，存在高处作业、坍塌、淹溺等风险。\n', '3', NULL, NULL, '9', 6, 1, NULL, '1', '2022-08-04 16:16:26', 'superadmin', '超管', '2022-08-15 17:24:18', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1558006933016907777', '二号线工程', '1', '0', NULL, '  佛山市城市轨道交通2 号线一期工程已于2021年12月28日正式通车，甩项工程8 项：\n  1.湾华站：湾华站电扶梯已通过验收；\n  2.湾华联络线施工完毕已通过验收。\n  3.湖涌站：A2出入口施工完毕，人行天桥附属设施正进行施工。\n  4.南庄站：A出入口施工完毕，等待验收。\n  5.广州南站：换乘通道及应急疏散口暂不具备施工条件。\n  6.张槎站：换乘通道及地下空间环形道路暂不具备施工条件。\n  7.湾华控制中心：线网指挥中心方案待定。\n  8.石湾主变电所景观平台。', '3', NULL, NULL, '9', 13, 1, NULL, '1', '2022-08-12 16:26:14', '1544145698858913794', '普通用户', '2022-08-15 11:21:15', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1564865719207825410', '运营情况', '3', '0', NULL, '  目前我市运营的城市轨道交通线路共5条，分别为地铁广佛线、地铁2号线一期、广州地铁7号线一期西延顺德段、南海区新型公共交通首通段及高明区有轨电车示范线首通段，佛山境内运营里程81.7km（其中地铁65.6km、有轨电车16.1km）。', '3', NULL, NULL, '9', 1, 0, NULL, '1', '2022-08-31 14:40:36', '1544145698858913794', '普通用户', '2022-09-02 17:18:02', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1565625766342922242', '总体情况', '1', '0', '', '佛山市轨道交通建设总体情况\n（截止2022年9月7日，服务1标负责每月更新一次）\n  一、城市轨道交通工程：\n  目前我市在建城市轨道交通工程项目共4个，共139km（三号线工程69.5km、四号线一期工程56km、南海新交通工程3.6km、里水有轨电车9.9km），56个施工标段，共有30处危大工程，其中5个深基坑（三号线叠滘站；其他出入口及风亭4个），7台盾构机（分布于6个盾构区间，其中2台泥水盾构机），3个暗挖工程（佛山西站配线段左、右线，大学城站-科技学院站暗挖区间），2处高支模（叠滘站、兴业路站附属结构），13台起重设备（均为龙门吊）。\n  9月份重大风险管控项目11个（全部在三号线，其中一级管控8个、二级管控3个)，数量比8月份的13处减少2处（其中新增2处：一级风险管控中山公园站附属结构、大科暗挖区间（长度28.5米）；销号4处：一级风险管控火车站站附属结构、二级风险管控镇安站附属结构、桂丹路站至佛山机场站联络通道、大学城站）\n  二、省管铁路工程：\n  我市在建省管铁路项目4个（7个施工标段）。分别为广湛高铁（中铁二十五局GZZQ-2标、中铁广州局GZZQ-3标）、珠肇高铁（江机段中铁七局JJZQ-6标、高肇段中铁十五局GZZQ-1标）、南海一汽大众铁路专用线工程、南沙港铁路（中铁三局NSGZH7标和南沙港铁路中铁十一局NSGZQ-3标）。目前共有5处高风险工点（均在广湛高铁），危大工程共18处（其中7处深基坑、4处挂篮拆除工程、1处承重支撑体系、1处起重机械拆除工程、2处涉水工程、3段邻近铁路营业线施工）。\n  三、市轨道交通局质量安全监督管理：\n  1.城市轨道交通：8月份对4个项目、18个施工标段组织检查30项次，出动187人次，下发24份意见反馈表（含省安委会检查下发的3份）。共发现问题264个，其中安全151个，质量21个，管理行为92个。\n  2.省管铁路：8月份检查了4个项目、6个施工标段，出动46人次，下发6份意见反馈表。共发现问题41个，其中安全19个，质量3个，管理行为19个。\n  3.质量验收：佛山市城市轨道交通三号线工程共有单位（子单位）工程205个，其中首通段单位（子单位）工程128个。三号线首通段单位、子单位工程验收截至2022年8月31日共计正式验收单位（子单位）工程122/128个（子单位工程102个，单位工程20个），首通段验收完成率占比95.3%，目前剩余6个缓验单位工程，其中土建1个（逢沙停车场派出所）、机电5个（顺德学院站-大良站段人防、新松站~高村站段人防、北滘站-镇安站段人防、逢沙停车场派出所机电设备、逢沙停车场公安通信系统）。\n  4.诚信扣分：8月份对实施佛山市城市轨道交通建设行业企业诚信扣分共计40分/8份；省管铁路企业建议失信行为“扣分”共计3.5分/3份。\n\n\n\n\n\n', '6', 30, '2022-10-15 10:21:00', '9', 1, 0, NULL, '1', '2022-09-02 17:00:45', '1544145698858913794', '普通用户', '2022-09-15 10:21:00', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1565627239025971201', '二号线', '1', '0', NULL, '佛山市城市轨道交通2号线一期工程已于2021年12月28日正式通车，甩项工程8 项：\n  1.湾华站：湾华站电扶梯已通过验收；\n  2.湾华联络线施工完毕已通过验收。\n  3.湖涌站：A2出入口施工完毕，人行天桥附属设施正进行施工。\n  4.南庄站：A出入口施工完毕，等待验收。\n  5.广州南站：换乘通道及应急疏散口暂不具备施工条件。\n  6.张槎站：换乘通道及地下空间环形道路暂不具备施工条件。\n  7.湾华控制中心：线网指挥中心方案待定。\n  8.石湾主变电所景观平台。\n', '3', NULL, NULL, '9', 2, 0, NULL, '1', '2022-09-02 17:06:36', '1544145698858913794', '普通用户', '2022-09-19 11:30:39', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1565627362342703105', '三号线', '1', '0', NULL, '（截止2022年9月8，由服务2标每月更新）\n一、项目总体情况\n  佛山市城市轨道交通三号线南起顺德客运港站，北至科技学院站，为贯通佛山市南北的主干线，线路全长约为69.5公里，总投资425.72亿元。三号线共设37座车站（有4个车站已纳入其它线路同步实施)，高架车站3座，地下车站34座，全线设置1段2场，4座主变，1座控制中心。\n二、工程进展情况\n  8 月 1 日，3 号线首通段所有车站、轨行区、车辆基地、主\n变电所、控制中心完成了临时“三权”移交；8 月 6 日，首通段信号系统取得空载试运行独立第三方安全认证；8 月 10 日，首通段顺利通过项目工程验收；8 月 11 日，三号线首通段试运行；9 月 3日，大学城站-科技学院站盾构区间左线顺利始发，至此，全线盾构机全部完成始发。\n  1.土建施工：全线 38 个车站，35 个车站已实现主体结构封顶，目前 1 个站处于主体结构施工阶段、2 个站未进场围蔽；全线 36个区间，27 个区间已双线洞通，6 个区间 7  台盾构机下井施工。\n  2.机电施工：全线 37 个车站，28 个车站机电已进场；其中首通段车站设备安装及装修完成率已超 96.5%，全部车站单位工程验收完成，全部车站、区间已三权移交运营，BAS、FAS 单系统调试8 站基本完成 19 站过半，综合联调完成 79% 。首通段 9 个铺轨基地全部接管，已完成铺轨任务全部交还土建单位；首通段全部区间均已移交机电（包含左右线、场段出入场线）。区间弱电系统安装已全部完成，专用通信基本完成系统调试和联调，视频监控系统基本完成单机调试，19 站 14 区间运营商信号已开通 ，35KV电通完成，接触网完成 100%，顺德学院-镇安低中高速热滑均已完成。5 辆蓄电池工程车、33 列电客车出厂验收完成，30 列电客车到段，其中 24 列车辆动调完成。\n', '3', NULL, NULL, '9', 3, 0, NULL, '1', '2022-09-02 17:07:06', '1544145698858913794', '普通用户', '2022-09-14 10:55:29', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1565627498531753985', '四号线', '1', '0', NULL, '（截止2022年8月底，由服务2标每月更新）\n一、项目总体情况\n  佛山市城市轨道交通四号线一期西起三水区北江大道站，东至南海区港口路站，全长55.22km，其中地下段49.14km，过渡段0.82km，高架段5.26km。共设33座车站（地下站30座、高架站3座），其中换乘站14座，平均站间距约1.71km。设平胜车辆段和大堕山停车场、湾华控制中心，设三水主变、绿岛湖主变和平洲主变。最高运行速度为100km/h 。\n二、工程进展情况\n  土建工程部分：全线车站33座，目前2个车站进行交通疏解、围蔽区域内绿化迁改、路灯迁改、交通导改及临时围蔽等施工准备工作，2个进行主体结构桩基础、围护结构施工围护结构钻孔桩施工，2个现场未施工，3个未进场施工。全线区间34个，均未进入施工阶段。停车场1个、车辆段1个、出入场线1个，均未招标。\n三、质量安全总体概述\n  8月份，监督服务部对4个标段开展了日常监督检查4次。检查人员27人次，下发工程质量安全整改通知书3份，形成监督检查记录4份，提出质量安全问题共计26条，其中安全问题15条，占比58%；质量问题1条，占比4%；管理行为问题10条，占比38%。\n  通过检查对比，安全问题、质量问题、管理行为问题总体均呈下降趋势，其中管理行为问题显著好转。根据日常监督检查抽检情况，四号线一期工程土建工程施工质量安全处于总体可控状态。\n', '3', NULL, NULL, '9', 4, 0, NULL, '1', '2022-09-02 17:07:38', '1544145698858913794', '普通用户', '2022-09-26 14:29:03', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1565627684750462977', '区管项目', '1', '0', NULL, '（截止2022年9月5日，服务2标负责每月更新一次）\n一、里水有轨电车工程\n  南海区有轨电车里水示范段项目投资估算总额为21.864亿元，线路始于规划的里湖新城中轴线里湖新城站，线路沿环镇北路、草场工业大道、里广路敷设，止于里横路站，全长9.834公里,其中地面段7.063公里，地下段1.24公里，高架段1.531公里。全线共设车站13座，其中地下站1座（里官路站），换乘站2座，在岗美站与佛山地铁8号线换乘，在里横路站与广州地铁12号线换乘。车辆基地1座，占地面积约102亩。\n1.工程进展情况\n  项目总共分为三个标段，已于2021年3月开始进场施工。一标主要进行下穿隧道围护结构、基坑土方开挖，地基加固、路基填筑、里水涌、梅涌桥梁主体结构等施工。二标主要进行路基地基加固，路基填筑、佛山一环跨线桥桩基、墩身结构、车辆基地综合楼结构等施工。三标主要进行跨水口水道大桥主体结构施工、草场工业大道旧路与厂房间场地的地基处理、排水管道施工。\n  项目需完成管线改迁长度7600米，已完成迁改4470米，完成率58.82%。需迁移绿化909棵，目前草场工业大道及里广路两侧人行道的绿化迁移工作已基本完成，剩余中央绿化将根据施工进度进场配合开展工作。\n二、南海一汽大众工程\n  广东南海一汽大众铁路专用线概算总投资6.9亿元，采用设计施工总承包（EPC）模式实施建设。线路总长1.96km（铺轨长度10.56km）、无正线，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\n  截至目前已完成固投金额为 8300 万元，完成今年计划固投金额18000万元的46.11%；累计完成固投金额为6.7882亿元，占总投资金额6.89亿元的98.52%。\n 1.主要包括以下两项建设内容：\n  1.1.改造既有广珠铁路官窑站，增设到发线3条，预留1条；\n  1.1.在广珠铁路官窑站北侧新建综合性货场一处，设置3束5线货物线，另预留1条。\n  1.1.中标单位为中铁工程设计咨询集团有限公司；施工分包单位为中铁六局集团有限公司；监理单位为中铁一院集团南方工程咨询监理有限公司。\n  2.工程进展情况\n  2.1.路基工程：新建站场路基已完成路基填筑，剩余东西咽喉区顶进涵范围的路基填筑；开累完成99%，剩余1%。\n  2.2.框架桥涵接长工程6座：完成4座涵洞接长，剩余2座，开累完成60%，剩余40%需顶进涵顶进后接长。\n  2.3.官华路特大桥工程：桥梁下部结构及上部结构主体已全部完成；开累完成97.2%。剩余附属工程2.8%。\n  2.4.房屋建筑工程：已完站场内货运综合楼、单身宿舍楼、叉车库、储油间、仓库结构柱等主体结构的施工，剩余邻近既有铁路还建接触网工区（工程车库、储油间、材料库）、整备棚、轨道衡计量室、车号识别信号探测站、红外线探测房、官窑站信号楼接建的工程施工；开累完成73%，剩余27%。\n  2.5.路基附属工程：路基附属开累完成85%，剩余15%受顶进涵影响。\n  2.6.四电工程：四电工程已开始进行站场区域施工。开累完成40%。\n  2.7.轨道工程：开累完成61%，剩余39%。\n\n\n \n\n', '3', NULL, NULL, '9', 6, 0, NULL, '1', '2022-09-02 17:08:23', '1544145698858913794', '普通用户', '2022-09-14 11:05:19', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1565627736189407234', '省管铁路', '1', '0', NULL, '（截止2022年8月底，服务2标负责每月更新一次）\n一、项目总体情况\n  省管铁路在建铁路项目4个。广湛高铁佛山段共26.2km，含特大桥2座、路基1段，目前佛山特大桥桩基、承台及墩身正在施工。珠肇高铁江机段佛山境内共17.98km，含路基0.94km（8 段），桥梁12.41km（8 座，其中含有1座高架车站），隧道4.63km（5座），目前大顶隧道、跨茶山公路特大桥、宫溪特大桥、石仔岭2#隧道、茶山隧道、跨孔堂水库大桥、高明站特大桥、跨广明高速特大桥工点已开工；珠肇高铁高肇段佛山境内2.669km，含单线特大桥2座、双线特大桥1座，目前高明河特大桥工点已开工）；广州南沙港铁路站前施工已全部完成（货运已通车）；站后工程剩余2号扶梯正在施工，其他已全部完成。广东南海一汽大众专用线工程站前施工已全部完成；站后工程房屋建筑工程完成75%，四电工程完成50%。\n二、安全质量情况\n  1.质量安全总体概述\n  8月份，监督服务部对省管铁路项目6个标段监督检查7次，出动检查人员46人次，下发6份工程质量安全整改通知书，内部形成监督检查记录7份，提出整改问题41条，其中安全问题19条，质量问题3条，管理行为19条。\n  本月对危大工程进行全覆盖检查，发现起重吊装及装拆施工问题6个。基坑工程问题2个，安全防护问题2个。\n  本月省管铁路安全问题总体数量呈上升趋势，其中起重吊装及装拆施工、临时用电、疫情防控等问题数量呈上升趋势，现场消防、模板工程及支撑体系问题数量有所下降，安全防护基本持平，总体可控。\n', '3', NULL, NULL, '9', 5, 0, NULL, '1', '2022-09-02 17:08:35', '1544145698858913794', '普通用户', '2022-09-29 11:21:39', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1565629893185736706', '规划总体情况', '2', '0', NULL, '国家铁路：途经我市的国家铁路项目共12条（段），总里程403.49公里。\n城际铁路：途经我市的城际轨道交通项目7条（段），总里程287.42公里。\n城市轨道：2016年7月，市政府批复《佛山市城市轨道交通线网规划修编》。根据规划成果，我市规划地铁项目共14条，总长度为562公里。市自然资源局正在开展佛山市城市轨道交通线网规划修编工作并已通过专家评审，目前已向书记做专题汇报。根据现阶段规划成果，佛山市规划地铁项目共22条，总里程约761公里（后续将根据实际情况进一步调整优化）。\n有轨电车：根据2016年7月市政府批复《佛山市城市轨道交通线网规划修编》，我市规划有轨电车项目共19条，线网总规模433.3公里。\n', '3', NULL, NULL, '9', 1, 1, NULL, '1', '2022-09-02 17:17:09', '1544145698858913794', '普通用户', '2022-09-06 09:34:15', '1544145698858913794', '普通用户');
