INSERT INTO `t_section_menu` VALUES ('1572427612734722049', '规划总体情况', '2', '0', '', '国家铁路：途经我市的国家铁路项目共12条（段），总里程403.49公里。\n城际铁路：途经我市的城际轨道交通项目7条（段），总里程287.42公里。\n城市轨道：2016年7月，市政府批复《佛山市城市轨道交通线网规划修编》。根据规划成果，我市规划地铁项目共14条，总长度为562公里。市自然资源局正在开展佛山市城市轨道交通线网规划修编工作并已通过专家评审，目前已向书记做专题汇报。根据现阶段规划成果，佛山市规划地铁项目共22条，总里程约761公里（后续将根据实际情况进一步调整优化）。\n有轨电车：根据2016年7月市政府批复《佛山市城市轨道交通线网规划修编》，我市规划有轨电车项目共19条，线网总规模433.3公里。', '3', NULL, NULL, '9', 1, 0, NULL, '1', '2022-09-21 11:28:52', '1544145698858913794', '普通用户', '2022-09-21 11:29:10', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1572427862312587266', '深南高铁珠三角枢纽机场至省界段', '2', '0', '', '高铁项目，途经佛山（高明）、肇庆、云浮三市，全长约141.616公里，佛山境内约5.838公里，项目接入珠三角枢纽机场站。项目于2021年3月15日召开了预可研评审，于2021年11月22日-24日召开了工可评审，于2022年1月19日至20日召开了工可鉴修，目前正在开展社会稳定风险分析、征地拆迁框架协议签署等工程可行性研究前期工作，计划2022年内取得可研批复，力争2022年底前先行段开工建设。', '3', NULL, NULL, '9', 2, 0, NULL, '1', '2022-09-21 11:29:51', '1544145698858913794', '普通用户', '2022-09-21 11:30:23', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1572428215493955586', '广南联络）广州站至广州南站联络线', '2', '0', NULL, '高速铁路枢纽联络线工程项目，总投资76亿元，佛山段总投资28亿元，全长约15.633公里，佛山境内约4.45公里，未设置站点。项目可研预计2022年8月底前获批，省要求项目于2022年内动工建设。', '3', NULL, NULL, '9', 3, 0, NULL, '1', '2022-09-21 11:31:16', '1544145698858913794', '普通用户', '2022-09-22 15:54:18', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1572428349132869634', '柳广铁路', '2', '0', NULL, '普速铁路项目。线路西起柳州市，向东经广西来宾市、贵港市、梧州市至广东省肇庆市和广州市。线路设计全长415公里,其中大湾区内（广东省境内）里程230.41公里,我市境内预计约31.93公里，佛山段总投资约33.46亿元，预计在我市设置一座南边站（客货两用），项目已启动预可研工作，计划“十四五”期间动工。', '3', NULL, NULL, '9', 4, 0, NULL, '1', '2022-09-21 11:31:47', '1544145698858913794', '普通用户', '2022-09-21 11:31:59', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1572428429034360833', '广佛环线城际（佛山西站至广州北站段）', '2', '0', NULL, '广佛环线佛山西站至广州北站段线路自佛山西站城际场引出，经狮山、里水、炭步、江高，止于广州北站城际场。除佛山西站和广州北站外，全长约47.01公里，佛山境内约30.5公里，新设狮山东站、大榄站、官窑南站、和桂站4个客运车站（未计算佛山西站）。项目总投资228.06亿元，佛山段总投资估算约157.92亿元。项目工可已于2021年11月26日获批，项目初步设计已于2022年5月31日获批，省要求项目于2022年内开工建设。', '3', NULL, NULL, '9', 5, 0, NULL, '1', '2022-09-21 11:32:06', '1544145698858913794', '普通用户', '2022-09-21 11:32:15', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1572428497909026817', '佛莞城际', '2', '0', NULL, '线路全长约113公里，佛山境内约25.7公里，我市境内设10座车站，分别是三眼桥站、奇槎站、海八路站、叠滘站、普君北路站、人民公园站、文华公园站、澜石二路站、东平站、鹭洲站。项目总投资1140.6亿元，佛山段投资289亿元。目前，项目正在开展工程可行性研究等前期工作，计划于2022年8月16-17日召开项目工程可行性研究报告技术咨询专家评审会议。广州市希望本项目2022年底前开工建设。', '3', NULL, NULL, '9', 6, 0, NULL, '1', '2022-09-21 11:32:23', '1544145698858913794', '普通用户', '2022-09-22 15:41:01', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1572428562723606530', '肇顺南城际', '2', '0', NULL, '线路全长约150公里，佛山境内约89.2公里。项目总投资525亿元，佛山段投资224亿元。如按照城际方案，初步计划设置珠三角枢纽机场站、明城站、高明站、九江站、龙江站、龙潭站、马岗站、德胜站、顺德学院站合计9座。如按照高铁方案，初步计划设置珠三角枢纽机场站、高明站、龙江站、顺德学院站合计4座。肇顺南城际的功能定位有待进一步明确，广佛肇三市将争取项目提升为干线铁路并担任深南高铁的通道之一。项目正在开展前期研究工作，建议结合项目建设必要性和我市财政能力，综合评估项目建设时序，“十四五”期间以项目线站位方案研究和通道控制为主。', '3', NULL, NULL, '9', 7, 0, NULL, '1', '2022-09-21 11:32:38', '1544145698858913794', '普通用户', '2022-09-21 11:32:48', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1572428634899189762', '广佛江珠城际', '2', '0', NULL, '线路全长约88公里，佛山境内约46.9公里。按照2017年编制的工可方案和初步设计方案，计划设置三眼桥站、南海站、顺德北站、乐从站、龙江站合计5座。目前，项目东平新城-江门三江段（该段总投资约452.52亿，总里程约74.8公里，我市境内约24.25公里，我市境内投资约166.5亿），正在启动线站位方案研究等前期工作，初定在我市境内设置顺德北站、乐从、龙江北、龙江4座车站，并于2022年6月22日召开项目预可研审查。江门市希望广佛江珠城际顺德北站-江门段于2022年底取得可研批复，2023年6月开工建设。建议结合项目建设必要性和我市财政能力，综合评估项目建设时序，“十四五”期间以项目线站位方案研究和通道控制为主。', '3', NULL, NULL, '9', 8, 0, NULL, '1', '2022-09-21 11:32:56', '1544145698858913794', '普通用户', '2022-09-21 11:33:05', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1572428705447383041', '2号线二期', '2', '0', NULL, '线路起于高明区西安站，途径荷城街道、西樵镇，止于禅城区南庄站，线路长约23.5公里，设车站10座。项目总投资122.28亿元，计划2022年动工建设。目前市铁投集团正在同步组织开展项目工可报告及相关配套专题的编制工作。勘察设计总承包已完成招标，正启动开展总体设计和初步勘察设计工作。', '3', NULL, NULL, '9', 9, 0, NULL, '1', '2022-09-21 11:33:12', '1544145698858913794', '普通用户', '2022-09-22 15:38:32', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu` VALUES ('1572428766667444225', '11号线一期', '2', '0', NULL, '线路起于顺德区容奇渡口站，途径大良街道、伦教街道、北滘镇、陈村镇、三山新城，止于荔湾区鹤洞东站，根据项目可研阶段性成果，线路长约36.4公里（佛山段32.4公里，广州段4公里），设车站18座（佛山段16座，广州段2座）。项目总投资310.51亿元，其中佛山段总投资271.21亿元，计划2021年动工建设。目前，全线总平面方案已基本稳定，初步设计文件已基本完成。广佛两市正积极开展项目广州段舆情化解工作。', '3', NULL, NULL, '9', 10, 0, NULL, '1', '2022-09-21 11:33:27', '1544145698858913794', '普通用户', '2022-09-22 15:36:25', '1544145698858913794', '普通用户');
INSERT INTO `t_section_menu_audit` VALUES ('1555104895551508481', '总体情况', '1', '0', '', '  目前我市在建城市轨道交通工程项目共4个，共139km：三号线工程69.5km、四号线一期工程56km、南海新交通工程3.6km、里水有轨电车9.9km。\n  佛山市境内在建省管铁路项目4个，共115.5Km：为一汽大众铁路专用线项目、广湛高铁、珠肇高铁、广州南沙港铁 路。\n', '3', NULL, NULL, '3', 1, 1, NULL, '1', '2022-08-04 16:14:34', 'superadmin', '超管', '2022-09-02 16:39:12', '1544145698858913794', '普通用户', '6');
