INSERT INTO `t_system_log` VALUES ('1555101776813854722', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"4号线工程\",\"content\":\"（1）项目总体情况\\n佛山市城市轨道交通四号线一期西起三水区北江大道站，东至南海区港口路站，全长55.22km，其中地下段49.14km，过渡段0.82km，高架段5.26km。共设33座车站（地下站30座、高架站3座），其中换乘站14座，平均站间距约1.71km。设平胜车辆段和大堕山停车场、湾华控制中心，设三水主变、绿岛湖主变和平洲主变。最高运行速度为100km/h 。\\n（2）工程进展情况\\n截止2022年6月底，\\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 92.00, 1659600124518, '2022-08-04 16:02:11', 'superadmin', '超管', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1555101931055190018', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"轨道交通运营线路基本情况\",\"content\":\"目前我市运营的城市轨道交通线路共5条，分别为地铁广佛线、地铁2号线一期、广州地铁7号线一期西延顺德段、南海区新型公共交通首通段及高明区有轨电车示范线首通段，佛山境内运营里程81.7km（其中地铁65.6km、有轨电车16.1km）。\\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 90.00, 1659600161296, '2022-08-04 16:02:47', 'superadmin', '超管', NULL, NULL, NULL, 0);
