INSERT INTO `t_system_log` VALUES ('1555102113138315266', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"工程质量验收情况\",\"content\":\"（服务2标负责每月更新一次）\\n佛山地铁二号线一期工程：已于2021年12月28日通车，目前剩余8个甩项工程。\\n佛山市城市轨道交通三号线工程首通段：共有单位（子单位）工程128个，截至2022年7月16日正式验收子单位工程73个，单位工程21个，共计正式验收完成94/128个单位（子单位）工程，预验收完成103/128个单位（子单位）工程。\\n七号线工程顺德段：.已于2021年5月1日通车。\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":30}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 90.00, 1659600204707, '2022-08-04 16:03:31', 'superadmin', '超管', NULL, NULL, NULL, 0);
