INSERT INTO `t_system_log` VALUES ('1555102271108386818', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"里水有轨电车工程\",\"content\":\"（1）项目总体情况\\n广东南海一汽大众铁路专用线线路总长1.96km（铺轨长度10.56km）、无正线，概算总投资6.9亿元，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\\n（2）工程进展情况\\n截止2022年6月底，全线37个车站实现35个车站主体结构封顶；全线36个盾构区间实现23个区间，目前7个区间11台盾构机正在掘进施工；全线176个出入口（风亭）实现36个封顶；全线63个联络通道（废水泵房），完成33个。\\n目前21个车站整站移交机电安装，15个车站分区移交机电安装；6个铺轨基地接管，31个区间接管（包含左右线）；2个停车场、1个车辆段移交。 \\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 92.00, 1659600242368, '2022-08-04 16:04:08', 'superadmin', '超管', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1555102372866396162', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"南海新交通工程\",\"content\":\"（1）项目总体情况\\n南海区新型公共交通系统试验段工程线路全长13.1km，概算总投资44.1亿元，其中地下线3.681km，高架线7.626km，地面线1.888km，过渡段0.280km,全线设15个站（地下站4座、地面站3座、高架站8座），投资44.1亿元。\\n（2）工程进展情况\\n截止2022年6月底，全线37个车站实现35个车站主体结构封顶；全线36个盾构区间实现23个区间，目前7个区间11台盾构机正在掘进施工；全线176个出入口（风亭）实现36个封顶；全线63个联络通道（废水泵房），完成33个。\\n目前21个车站整站移交机电安装，15个车站分区移交机电安装；6个铺轨基地接管，31个区间接管（包含左右线）；2个停车场、1个车辆段移交。 \\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 90.00, 1659600266632, '2022-08-04 16:04:33', 'superadmin', '超管', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1555102530198933506', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"南海一汽大众工程\",\"content\":\"（1）项目总体情况\\n广东南海一汽大众铁路专用线线路总长1.96km（铺轨长度10.56km）、无正线，概算总投资6.9亿元，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\\n（2）工程进展情况\\n截止2022年6月底，全线37个车站实现35个车站主体结构封顶；全线36个盾构区间实现23个区间，目前7个区间11台盾构机正在掘进施工；全线176个出入口（风亭）实现36个封顶；全线63个联络通道（废水泵房），完成33个。\\n目前21个车站整站移交机电安装，15个车站分区移交机电安装；6个铺轨基地接管，31个区间接管（包含左右线）；2个停车场、1个车辆段移交。 \\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 95.00, 1659600304138, '2022-08-04 16:05:10', 'superadmin', '超管', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1555102632514785281', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"全市在建项目基本情况\",\"content\":\"佛山市目前在建城市轨道交通工程项目共4个，共139km，分别为佛山市城市轨道交通三号线工程(69.5km)、佛山市城市轨道交通四号线一期工程(56km)、南海区新型公共交通工程(3.6km)、里水有轨电车项目(9.9km)，近期市规划建设城市轨道交通工程项目2个，共59.8km，分别为佛山市城市轨道交通2号线二期、十一号线。\\n佛山境内铁路在建项目4个，共115.5Km，为一汽大众铁路专用线项目、广湛高铁、珠肇高铁、广州南沙港铁路，近期计划开工铁路项目3个，共73.4km，分别为广佛环线（佛山西站-广州北站段）、佛山经广州至东莞城际佛山段（广州地铁28号线佛山段）、广州南至广州联络线。\\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 90.00, 1659600328532, '2022-08-04 16:05:35', 'superadmin', '超管', NULL, NULL, NULL, 0);
