INSERT INTO `t_system_log` VALUES ('1555102914489454594', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"危大工程\",\"content\":\"1、轨道交通工程\\n全市共5个项目在施工（56个施工标段）；共有44处危大工程，其中共8个深基坑（三号线叠滘站、大学城站；其他出入口及风亭6个）；6个盾构区间（9台盾构机，其中4台泥水盾构机）；6个暗挖工程（4个暗挖联络通道：2个正在进行二衬施工，1个正在进行冷冻孔钻孔施工,1个待开挖；2个暗挖区间：佛山西站配线段左右线）；5处高支模（叠滘站、大科区间、大学城站、其它车站附属结构2处）；16台起重设备（塔吊2台、门吊11台。单梁吊2台。履带吊1台）有限空间作业11处（盾构9处，暗挖2处）。\\n2、省管铁路\\n省管铁路7月份危大工程共20处，具体如下：\\n共7处挂篮安装及移动工程（广珠广茂联络线下行线跨广三高速公路55-58#墩（62+112+62）m连续梁2处、广珠广茂联络线上行线60-63#墩（32+46+32）m连续梁2处、广珠广茂联络线上行线69-72#墩（40+56+40）m连续梁2处、佛山特大桥连续梁193#墩1处）；\\n共2处承重支撑体系（广珠广茂联络线上行线96m钢桁梁1处、120m系杆拱桥1处）；\\n共9处起重吊装及设备工程（2台架桥机、履带吊7台）；\\n共2处水上作业工程（跨东平水道桥1处（双壁钢围堰施工）、跨西江桥1处（钢围堰施工））。\\n\",\"indexFlag\":\"3\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 95.00, 1659600395759, '2022-08-04 16:06:42', 'superadmin', '超管', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1555103014355832833', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"在建项目的涉水工程\",\"content\":\"截止6月底\\n佛山市城市轨道交通工程无涉水工程。\\n佛山市城市轨道交通3处涉水地下工程分别是：1）镇安站～桂城站区间（3205-1标中建交通），左线394环/873环，地面加固已完成，盾构机停机保压准备开仓（目前未到下穿水系位置，607-654环下穿佛山涌、720-785环下穿奇丰横涌，距离佛山涌213环）。2）狮～大区间（3206-3标中铁十一局），左线1335环/1643环，停机保压，已在堤坝下方，即将下穿主水库（下穿水库位置1215环－1615环，下穿水库400环，目前下穿水库120环，剩余348环）；右线1596环/1643环（下穿水库位置1180环－1575环），已安全穿过水库，不再涉水，目前停机保压。 3）北～高区间3#联络通道（7号线土建04标中国中铁），位于林西河下方，目前正在积极冻结中。\\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"3\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 92.00, 1659600419572, '2022-08-04 16:07:06', 'superadmin', '超管', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1555103106219479041', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/release', 'POST', ' {\"sectionId\":\"1\",\"title\":\"重大风险情况\",\"content\":\"截止6月底\\n全市在建城市轨道交通工程目前在施工的共有8个重大风险（8个Ⅰ级管控和10个Ⅱ级管控），其中盾构Ⅰ级管控5个，深基坑Ⅰ级管控3个。\",\"indexFlag\":\"3\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 90.00, 1659600441476, '2022-08-04 16:07:28', 'superadmin', '超管', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1555103145482358786', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/update', 'PUT', ' {\"sectionId\":\"1\",\"title\":\"危大工程\",\"content\":\"1、轨道交通工程\\n全市共5个项目在施工（56个施工标段）；共有44处危大工程，其中共8个深基坑（三号线叠滘站、大学城站；其他出入口及风亭6个）；6个盾构区间（9台盾构机，其中4台泥水盾构机）；6个暗挖工程（4个暗挖联络通道：2个正在进行二衬施工，1个正在进行冷冻孔钻孔施工,1个待开挖；2个暗挖区间：佛山西站配线段左右线）；5处高支模（叠滘站、大科区间、大学城站、其它车站附属结构2处）；16台起重设备（塔吊2台、门吊11台。单梁吊2台。履带吊1台）有限空间作业11处（盾构9处，暗挖2处）。\\n2、省管铁路\\n省管铁路7月份危大工程共20处，具体如下：\\n共7处挂篮安装及移动工程（广珠广茂联络线下行线跨广三高速公路55-58#墩（62+112+62）m连续梁2处、广珠广茂联络线上行线60-63#墩（32+46+32）m连续梁2处、广珠广茂联络线上行线69-72#墩（40+56+40）m连续梁2处、佛山特大桥连续梁193#墩1处）；\\n共2处承重支撑体系（广珠广茂联络线上行线96m钢桁梁1处、120m系杆拱桥1处）；\\n共9处起重吊装及设备工程（2台架桥机、履带吊7台）；\\n共2处水上作业工程（跨东平水道桥1处（双壁钢围堰施工）、跨西江桥1处（钢围堰施工））。\\n\",\"indexFlag\":\"3\",\"status\":\"6\",\"updateFlag\":\"3\",\"id\":\"1555102888925171713\",\"buttonType\":\"cancel\"}', '成功', '重要消息修改接口', '172.19.0.3', '', NULL, 205.00, 1659600450720, '2022-08-04 16:07:37', 'superadmin', '超管', NULL, NULL, NULL, 0);
