INSERT INTO `t_system_log` VALUES ('1555103536999665665', NULL, NULL, NULL, 'superadmin', '超级管理员', '/top_msg_audit/update', 'PUT', ' {\"sectionId\":\"1\",\"title\":\"在建项目的涉水工程\",\"content\":\"截止6月底\\n佛山市城市轨道交通工程无涉水工程。\\n佛山市城市轨道交通3处涉水地下工程分别是：1）镇安站～桂城站区间（3205-1标中建交通），左线394环/873环，地面加固已完成，盾构机停机保压准备开仓（目前未到下穿水系位置，607-654环下穿佛山涌、720-785环下穿奇丰横涌，距离佛山涌213环）。2）狮～大区间（3206-3标中铁十一局），左线1335环/1643环，停机保压，已在堤坝下方，即将下穿主水库（下穿水库位置1215环－1615环，下穿水库400环，目前下穿水库120环，剩余348环）；右线1596环/1643环（下穿水库位置1180环－1575环），已安全穿过水库，不再涉水，目前停机保压。 3）北～高区间3#联络通道（7号线土建04标中国中铁），位于林西河下方，目前正在积极冻结中。\\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"3\",\"status\":\"6\",\"updateFlag\":\"3\",\"id\":\"1555102988791549954\",\"buttonType\":\"cancel\"}', '成功', '重要消息修改接口', '172.19.0.3', '', NULL, 203.00, 1659600544069, '2022-08-04 16:09:10', 'superadmin', '超管', NULL, NULL, NULL, 0);
