INSERT INTO `t_system_log` VALUES ('1555104270352748545', NULL, NULL, NULL, 'superadmin', '超级管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104186227593218\",\"title\":\"4号线工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（1）项目总体情况\\n佛山市城市轨道交通四号线一期西起三水区北江大道站，东至南海区港口路站，全长55.22km，其中地下段49.14km，过渡段0.82km，高架段5.26km。共设33座车站（地下站30座、高架站3座），其中换乘站14座，平均站间距约1.71km。设平胜车辆段和大堕山停车场、湾华控制中心，设三水主变、绿岛湖主变和平洲主变。最高运行速度为100km/h 。\\n（2）工程进展情况\\n截止2022年6月底，\\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 121.00, 1659600718992, '2022-08-04 16:12:05', 'superadmin', '超管', NULL, NULL, NULL, 0);
