INSERT INTO `t_system_log` VALUES ('1555104364942692353', NULL, NULL, NULL, 'superadmin', '超级管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104291169079297\",\"title\":\"城市轨道运营线路基本情况\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"目前我市运营的城市轨道交通线路共5条，分别为地铁广佛线、地铁2号线一期、广州地铁7号线一期西延顺德段、南海区新型公共交通首通段及高明区有轨电车示范线首通段，佛山境内运营里程81.7km（其中地铁65.6km、有轨电车16.1km）。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 124.00, 1659600741541, '2022-08-04 16:12:28', 'superadmin', '超管', NULL, NULL, NULL, 0);
