INSERT INTO `t_system_log` VALUES ('1555104624050016257', NULL, NULL, NULL, 'superadmin', '超级管理员', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1555104547495579649\",\"title\":\"里水有轨电车工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"（1）项目总体情况\\n广东南海一汽大众铁路专用线线路总长1.96km（铺轨长度10.56km）、无正线，概算总投资6.9亿元，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\\n（2）工程进展情况\\n截止2022年6月底，全线37个车站实现35个车站主体结构封顶；全线36个盾构区间实现23个区间，目前7个区间11台盾构机正在掘进施工；全线176个出入口（风亭）实现36个封顶；全线63个联络通道（废水泵房），完成33个。\\n目前21个车站整站移交机电安装，15个车站分区移交机电安装；6个铺轨基地接管，31个区间接管（包含左右线）；2个停车场、1个车辆段移交。 \\n\",\"status\":\"3\",\"updateFlag\":\"3\"}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 210.00, 1659600803226, '2022-08-04 16:13:29', 'superadmin', '超管', NULL, NULL, NULL, 0);
