INSERT INTO `t_system_log` VALUES ('1555104768472485890', NULL, NULL, NULL, 'superadmin', '超级管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104696745693185\",\"title\":\"南海新交通工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（1）项目总体情况\\n南海区新型公共交通系统试验段工程线路全长13.1km，概算总投资44.1亿元，其中地下线3.681km，高架线7.626km，地面线1.888km，过渡段0.280km,全线设15个站（地下站4座、地面站3座、高架站8座），投资44.1亿元。\\n（2）工程进展情况\\n截止2022年6月底，全线37个车站实现35个车站主体结构封顶；全线36个盾构区间实现23个区间，目前7个区间11台盾构机正在掘进施工；全线176个出入口（风亭）实现36个封顶；全线63个联络通道（废水泵房），完成33个。\\n目前21个车站整站移交机电安装，15个车站分区移交机电安装；6个铺轨基地接管，31个区间接管（包含左右线）；2个停车场、1个车辆段移交。 \\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 110.00, 1659600837763, '2022-08-04 16:14:04', 'superadmin', '超管', NULL, NULL, NULL, 0);
