INSERT INTO `t_system_log` VALUES ('1555105188196487170', NULL, NULL, NULL, 'superadmin', '超级管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555105070609174530\",\"title\":\"危大工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"截止6月底\\n1、轨道交通工程\\n全市共5个项目在施工（56个施工标段）；共有44处危大工程，其中共8个深基坑（三号线叠滘站、大学城站；其他出入口及风亭6个）；6个盾构区间（9台盾构机，其中4台泥水盾构机）；6个暗挖工程（4个暗挖联络通道：2个正在进行二衬施工，1个正在进行冷冻孔钻孔施工,1个待开挖；2个暗挖区间：佛山西站配线段左右线）；5处高支模（叠滘站、大科区间、大学城站、其它车站附属结构2处）；16台起重设备（塔吊2台、门吊11台。单梁吊2台。履带吊1台）有限空间作业11处（盾构9处，暗挖2处）。\\n2、省管铁路\\n省管铁路7月份危大工程共20处，具体如下：\\n共7处挂篮安装及移动工程（广珠广茂联络线下行线跨广三高速公路55-58#墩（62+112+62）m连续梁2处、广珠广茂联络线上行线60-63#墩（32+46+32）m连续梁2处、广珠广茂联络线上行线69-72#墩（40+56+40）m连续梁2处、佛山特大桥连续梁193#墩1处）；\\n共2处承重支撑体系（广珠广茂联络线上行线96m钢桁梁1处、120m系杆拱桥1处）；\\n共9处起重吊装及设备工程（2台架桥机、履带吊7台）；\\n共2处水上作业工程（跨东平水道桥1处（双壁钢围堰施工）、跨西江桥1处（钢围堰施工））。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 114.00, 1659600937829, '2022-08-04 16:15:44', 'superadmin', '超管', NULL, NULL, NULL, 0);
