INSERT INTO `t_system_log` VALUES ('1557273073887055874', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1555105070609174530\",\"title\":\"危大工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"1、轨道交通工程\\n1.城市轨道交通工程:目前全市共5个项目在施工（56个施工标段）；共有39处危大工程，其中8个深基坑（三号线叠滘站、大学城站；其他出入口及风亭6个）；5个盾构区间（6台盾构机，其中2台泥水盾构机）；3个暗挖工程（1个暗挖联络通道正在进行积水泵房施工；2个暗挖区间：佛山西站配线段左、右线）；6处高支模（叠滘站、大科区间、大学城站、其它车站附属结构3处）；16台起重设备（塔吊2台、龙门吊11台、桥式起重机2台、履带吊1台）；有限空间作业9处（盾构6处，暗挖3处）。2022年8月份重大风险管控项目13个（全部在三号线，其中一级管控7个、二级管控6个)，数量比7月份减少3处，其中：一级风险管控减少1处（镇安站-桂城站区间盾构区间）；二级风险管控减少2处（佛山机场站附属结构、狮山站-大学城站区间联络通道）。\\n2、省管铁路\\n（1）省管铁路（佛山段）目前在建4个项目（7个施工标段），共有5处高风险工点均在广湛高铁（见附表3）。\\n（2）省管铁路8月份危大工程共31处，具体如下：\\na.4处基坑工程（珠肇高铁GZZQ-1标1处、珠肇高铁JJZQ-6标2处、广湛高铁GZZQ-3标1处）；\\nb.8处挂篮安装及移动工程（广珠广茂联络线下行线跨广三高速公路55-58#墩（62+112+62）m连续梁2处、广珠广茂联络线上行线60-63#墩（32+46+32）m连续梁2处、广珠广茂联络线上行线69-72#墩（40+56+40）m连续梁2处、佛山特大桥连续梁193#墩2处）；\\nc.2处承重支撑体系（广珠广茂联络线上行线96m钢桁梁1处、120m系杆拱桥1处）；\\nd.10处起重吊装及设备工程（2台塔吊、8台履带吊）；\\ne.2台架桥机(广珠广茂联络线上行线特大桥、下行线特大桥）：\\nf.2处水上作业工程：（跨东平水道桥水上栈桥及双壁钢围堰施工、跨西江桥水上栈桥及钢围堰施工）：\\ng.3段邻近营业线、存在影响铁路运营安全风险的路基施工：（广珠广茂联络线路基的共线段、上行线及下行线）。\",\"status\":\"9\",\"updateFlag\":\"3\"}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 253.00, 1660117801922, '2022-08-10 15:50:08', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
