INSERT INTO `t_system_log` VALUES ('1557276751322779650', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1555105365795901442\",\"title\":\"重大风险情况\",\"sectionId\":\"1\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"全市在建轨道交通工程目前在施工的共有18处重大风险：\\n1、城市轨道交通8月份二级及以上风险管控措施的重大风险管控点共有13处，具体如下：                            \\n盾构掘进一级风险管控5处,分别是：\\n（1）南～叠区间（3205-2标中建四局）右线富水砂层/盾构在较长范围内叠线施工，两线隧道净间距2.4-3米（小净距施工），即将进入叠线加固段施工，加固段1000环开始；\\n（2）叠～中区间（3205-2标中建四局）右线富水砂层/穿越海天废弃厂房（桩基为素混凝土桩）/文沙大桥（钻孔灌注桩，与其水平净距约2.6m。）；\\n（3）中～火区间（3205-2标中建四局）右线富水砂层/下穿文昌大桥/火车站地下人防/综合批发市场7栋商铺（商铺为天然基础）；\\n（4）火～桂区间（3205-3标中建三局）左线富水砂层/车世界二期B、C栋（区间隧道与房屋桩基有冲突）；\\n（5）佛～罗区间（3205-3标中建三局）左线下穿军事输油管及营房/上跨广佛环区间隧道，右线即将接收。\\n车站、附属深基坑一级风险管控2个（均在3205-2标中建四局）：\\n（1）叠滘站东区深基坑及C出入口施工（富水砂层、管线保护和建筑物）；\\n（2）火车站附属结构A出入口顶板施工（富水砂层、近建筑物、燃气管/雨水箱涵迁改及保护）。    \\n2、省管铁路（佛山段）目前在建4个项目（7个施工标段），共有5处高风险工点均在广湛高铁。\\n\",\"status\":\"9\",\"updateFlag\":\"3\"}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 230.00, 1660118678714, '2022-08-10 16:04:45', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
