INSERT INTO `t_system_log` VALUES ('1557279432468697090', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1555104791264333825\",\"title\":\"南海一汽大众工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"（1）项目总体情况\\n广东南海一汽大众铁路专用线线路总长1.96km（铺轨长度10.56km）、无正线，概算总投资6.9亿元，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\\n（2）工程进展情况（截止2022年7月底）\\n1、站场路基：站场核心区已基本完成填筑；\\n2、站场附属：站场排水沟、挡土墙、浆砌片石、站场坡脚排水槽等累计完成约95%；\\n3、跨官华路特大桥：正在进行桥面附属结构工程施工；\\n4、站场房建：综合楼、宿舍楼已完成封顶，正在进行装饰装修；\\n5、轨道工程：站场核心区新增3 股到发线，以及货场区3束6线已完成轨道铺设；\\n6、四电及设备工程：房建部分机电已开始施工，站场已完成部分电力线及通讯线管沟施工。\\n\\n\",\"status\":\"9\",\"updateFlag\":\"3\"}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 237.00, 1660119317941, '2022-08-10 16:15:24', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1557279452114817025', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104791264333825\",\"title\":\"南海一汽大众工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（1）项目总体情况\\n广东南海一汽大众铁路专用线线路总长1.96km（铺轨长度10.56km）、无正线，概算总投资6.9亿元，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\\n（2）工程进展情况（截止2022年7月底）\\n1、站场路基：站场核心区已基本完成填筑；\\n2、站场附属：站场排水沟、挡土墙、浆砌片石、站场坡脚排水槽等累计完成约95%；\\n3、跨官华路特大桥：正在进行桥面附属结构工程施工；\\n4、站场房建：综合楼、宿舍楼已完成封顶，正在进行装饰装修；\\n5、轨道工程：站场核心区新增3 股到发线，以及货场区3束6线已完成轨道铺设；\\n6、四电及设备工程：房建部分机电已开始施工，站场已完成部分电力线及通讯线管沟施工。\\n\\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 98.00, 1660119322765, '2022-08-10 16:15:29', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
