INSERT INTO `t_system_log` VALUES ('1557294091003334657', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1555104696745693185\",\"title\":\"南海新交通工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"（1）项目总体情况\\n南海区新型公共交通系统试验段工程线路全长13.1km，概算总投资44.1亿元，其中地下线3.681km，高架线7.626km，地面线1.888km，过渡段0.280km,全线设15个站（地下站4座、地面站3座、高架站8座），投资44.1亿元。\\n（2）工程进展情况（截止2022年7月底）\\n南海区轨道交通工程在建项目共2 个，分别为南海新交通项目，施工标段共2 个、有轨电车里水示范段工，施工标段共3 个。南海新交通项目：首通段（雷岗站至三山新城北站共10 个站）已开通，后通段（三山新城南至林岳东站共5 个站）机电专业已于8 月1 日完成单位工程正式验收。\\n\",\"status\":\"9\",\"updateFlag\":\"3\"}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 192.00, 1660122812856, '2022-08-10 17:13:39', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
