INSERT INTO `t_system_log` VALUES ('1557294503148228609', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1555104036637741057\",\"title\":\"三号线工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"（1）项目总体情况\\n佛山市城市轨道交通三号线南起顺德客运港站，北至科技学院站，为贯通佛山市南北的主干线，线路全长约为69.5公里，总投资425.72亿元。三号线共设37座车站（有4个车站已纳入其它线路同步实施)，高架车站3座，地下车站34座，全线设置1段2场，4座主变，1座控制中心。\\n（2）工程进展情况（截止2022年7月底）\\n机电、装饰装修方面，首通段（顺德站至镇安站）常规机电及砌筑、装饰装修专业施工进度约为90%，弱电系统施工进度约为97%，供电系统施工已完成，屏蔽门施工已完成，电梯施工进度约为92%；后通段机电专业个别标段仅有少量施工，主要施工内容有：博爱中路站、佛科院仙溪校区站、罗村站二次结构，狮山车辆段轨道和机电工程。\\n\",\"status\":\"9\",\"updateFlag\":\"3\"}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 223.00, 1660122911087, '2022-08-10 17:15:17', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
