INSERT INTO `t_system_log` VALUES ('1558008358442733570', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1558006933016907777\",\"title\":\"二号线工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"  佛山市城市轨道交通2 号线一期工程已于2021 年12 月28 日正式通车， 甩项工程8 项：\\n1、湾华站：湾华站电扶梯已通过验收；\\n2、湾华联络线施工完毕已通过验收。\\n3、湖涌站：A2 出入口施工完毕，人行天桥附属设施正进行施工。\\n4、南庄站：A 出入口施工完毕，等待验收。\\n5、广州南站：换乘通道及应急疏散口暂不具备施工条件。\\n6、张槎站：换乘通道及地下空间环形道路暂不具备施工条件。\\n7、湾华控制中心：线网指挥中心方案待定。\\n8、石湾主变电所景观平台。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 152.00, 1660293107521, '2022-08-12 16:31:54', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
