INSERT INTO `t_system_log` VALUES ('1558009379155972098', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104380113489922\",\"title\":\"工程质量验收情况\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（服务2标负责每月更新一次）\\n  检查4 个城市轨道项目（地铁2 号线一期甩项工程、地铁三号线、地铁四号线一期工程、南海新交通）21 个标段，4 个\\n铁路项目（南海一汽大众铁路专用线工程、广湛高铁、广州南沙港铁路和珠肇高铁）7 个标段。\\n  累计组织监督检查38 次、出动检查人员185 人次，下发工程质量安全整改通知书11 份、内部形成监督检查记录38 份，查出质量安全问题共计130 条，其中安全问题56 条、质量问题4 条、管理行为问题70条，重大事故隐患2 个。\\n  截止7 月份，应提交整改回复资料8 份，提交整改闭合资料共8 份，回复率100%。形成违规行为扣分记录5 次（地铁三号线2 次、地铁四号线一期工程3 ）。\\n  检测服务部对在建轨道交通工程项目6 个标段进行原材料、（半）成品抽检，共抽检16 种（类）、42 组，已出结果22 组，合格22 组，合格率为100%；对3 个标段进行工程实体检测，共检测5 项参数、18 个数据，合格18 个，合格率为100%。其中，对三号线工程3206-3 标进行隧道衬砌外观及\\n错台检测，共检测600 环，发现病害26 处，下发监督检测通知单1 份。\\n\",\"updateFlag\":\"6\",\"updateRate\":30}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 150.00, 1660293350881, '2022-08-12 16:35:57', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
