INSERT INTO `t_system_log` VALUES ('1559014880199151617', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/release', 'POST', ' {\"id\":\"1555102888925171713\",\"sectionId\":\"1\",\"title\":\"危大工程情况\",\"content\":\"全市轨道交通行业共70处危大工程，分别为：\\n  1.城市轨道交通39处危大工程：8处深基坑、5个盾构区间(6台盾构机)、3个暗挖工程、6处高支模、16台起重设备、9处有限空间作业 ；\\n  2.省管铁路31处危大工程：4处深基坑、8处挂篮安装及移动工程、2处承重支撑体系、12处起重吊装及设备工程、2处涉水工程、3段邻近铁路营业线施工；\\n\\n\\n\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":25}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 120.00, 1660533081039, '2022-08-15 11:11:27', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
