INSERT INTO `t_system_log` VALUES ('1559015832662675457', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/release', 'POST', ' {\"id\":\"1557263106547224578\",\"sectionId\":\"3\",\"title\":\"全市运营线路基本情况\",\"content\":\"  目前我市运营的城市轨道交通线路共5条，分别为地铁广佛线、地铁2号线一期、广州地铁7号线一期西延顺德段、南海区新型公共交通首通段及高明区有轨电车示范线首通段，佛山境内运营里程81.7km（其中地铁65.6km、有轨电车16.1km）。\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 134.00, 1660533308108, '2022-08-15 11:15:14', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
