INSERT INTO `t_system_log` VALUES ('1559016147394859010', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104895551508481\",\"title\":\"全市在建项目基本情况\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"  佛山市目前在建城市轨道交通工程项目共4个，共139km，分别为佛山市城市轨道交通三号线工程(69.5km)、佛山市城市轨道交通四号线一期工程(56km)、南海区新型公共交通工程(3.6km)、里水有轨电车项目(9.9km)，近期市规划建设城市轨道交通工程项目2个，共59.8km，分别为佛山市城市轨道交通2号线二期、十一号线。\\n  佛山境内铁路在建项目4个，共115.5Km，为一汽大众铁路专用线项目、广湛高铁、珠肇高铁、广州南沙港铁路，近期计划开工铁路项目3个，共73.4km，分别为广佛环线（佛山西站-广州北站段）、佛山经广州至东莞城际佛山段（广州地铁28号线佛山段）、广州南至广州联络线。\\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 166.00, 1660533383113, '2022-08-15 11:16:29', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
