INSERT INTO `t_system_log` VALUES ('1559016749453643778', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104547495579649\",\"title\":\"里水有轨电车工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"一、项目总体情况\\n  广东南海一汽大众铁路专用线线路总长1.96km（铺轨长度10.56km）、无正线，概算总投资6.9亿元，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\\n二、工程进展情况（截止2022年7月底）\\n  项目总共分为三个标段。一标主要进行下穿隧道围护结构、基坑土方开挖，地基加固、路基填筑、里水涌、梅涌桥梁主体结构等施工。二标主要进行路基地基加固，路基填筑、佛山一环跨线桥桩基、墩身结构、车辆基地综合楼结构等施工。三标主要进行跨水口水道大桥主体结构施工、草场工业大道旧路与厂房间场地的地基处理、排水管道施工。\\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 120.00, 1660533526705, '2022-08-15 11:18:53', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
