INSERT INTO `t_system_log` VALUES ('1559016911219560449', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555105220358410242\",\"title\":\"在建项目涉水工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"  佛山市轨道交通工程涉水工程共2处，均在广湛高铁（跨东平水道桥水上栈桥及双壁钢围堰施工、跨西江桥水上栈桥及钢围堰施工）。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 119.00, 1660533565274, '2022-08-15 11:19:31', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
