INSERT INTO `t_system_log` VALUES ('1559061739672276994', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/release', 'POST', ' {\"id\":\"1557267358430629889\",\"sectionId\":\"1\",\"title\":\"三防工作情况\",\"content\":\"三防信息（截止8月5日）：\\n  1.全市在建轨道交通工程目前低洼易涝点共14处。佛山市轨道交通三号线10处、佛山市轨道交通四号线1处、二号线2处、南海有轨电车里水示范段和南海区新型公交系统试验段各1处。\\n  2.全市轨道交通在建工共453处地板房均已加固，板房居住施工人员2170人，三防期间根据相关要求及时撤离板房居住人员。\\n  3.全市轨道交通领域在建工地应急抢险队伍39支，运营单位12支，三防物资起重设备15台、挖掘机15台、装载机4台、发电机29台、水泵255台、运输车辆10辆。\\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 114.00, 1660544253216, '2022-08-15 14:17:39', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
