INSERT INTO `t_system_log` VALUES ('1559097469740093442', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104895551508481\",\"title\":\"全市在建项目基本情况\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"  目前我市在建城市轨道交通工程项目共4个，共139km：三号线工程69.5km、四号线一期工程56km、南海新交通工程3.6km、里水有轨电车9.9km。\\n  佛山市境内在建省管铁路项目4个，共115.5Km：为一汽大众铁路专用线项目、广湛高铁、珠肇高铁、广州南沙港铁路。\\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 155.00, 1660552771886, '2022-08-15 16:39:38', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
