INSERT INTO `t_system_log` VALUES ('1559108173872336898', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104186227593218\",\"title\":\"四号线工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（截止2022年7月底，由服务2标每月更新）\\n一、项目总体情况\\n  佛山市城市轨道交通四号线一期西起三水区北江大道站，东至南海区港口路站，全长55.22km，其中地下段49.14km，过渡段0.82km，高架段5.26km。共设33座车站（地下站30座、高架站3座），其中换乘站14座，平均站间距约1.71km。设平胜车辆段和大堕山停车场、湾华控制中心，设三水主变、绿岛湖主变和平洲主变。最高运行速度为100km/h 。\\n二、工程进展情况\\n  目前四号线一期工程进场共4 个标段、共6 个车站，4 个车站进行交通疏解、围蔽区域内绿化迁改、管线迁改、地质勘探工作、交通导改及临时围蔽等施工准备工作，2 个车站进行围护结构钻孔桩施工。本月对佛山地铁四号线一期工程4 个标段报监资料进行了审核。\\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 100.00, 1660555324004, '2022-08-15 17:22:10', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
