INSERT INTO `t_system_log` VALUES ('1559108406547156993', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104380113489922\",\"title\":\"工程质量验收情况\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（截止2022年7月底，服务2标负责每月更新一次）\\n  1.检查4个城市轨道项目（地铁2号线一期甩项工程、地铁三号线、地铁四号线一期工程、南海新交通）21个标段，4个铁路项目（南海一汽大众铁路专用线工程、广湛高铁、广州南沙港铁路和珠肇高铁）7个标段。\\n  2.累计组织检查38次、出动检查人员185人次，下发工程质量安全整改通知书11份、内部形成监督检查记录38份，查出质量安全问题共计130条，其中安全问题56条、质量问题4条、管理行为问题70条，重大事故隐患2个。截止7月31日，应提交整改回复资料8份，提交整改闭合资料共8份，回复率100%。形成违规行为扣分记录5次（地铁三号线2次、地铁四号线一期工程3次）。\\n 3. 对在建轨道交通工程项目6个标段进行原材料、（半）成品抽检，共抽检16种（类）、42组，已出结果22组，合格22组，合格率为100%；对3个标段进行工程实体检测，共检测5项参数、18个数据，合格18个，合格率为100%。其中，对三号线工程3206-3标进行隧道衬砌外观及错台检测，共检测600环，发现病害26处，下发监督检测通知单1份。\\n\",\"updateFlag\":\"6\",\"updateRate\":30}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 126.00, 1660555379452, '2022-08-15 17:23:06', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
