INSERT INTO `t_system_log` VALUES ('1559442545305554945', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/release', 'POST', ' {\"id\":\"1555102606937919490\",\"sectionId\":\"1\",\"title\":\"全市在建项目基本情况\",\"content\":\"1.全市在建城市轨道交通工程共4个项目（56个施工标段），共139km。\\n  分别为：三号线工程69.5km，四号线一期工程56km，南海新交通工程3.6km，里水有轨电车工程9.9km。\\n2.佛山境内铁路在建项目4个，共115.5Km。\\n  分别为：一汽大众铁路专用线项目、广湛高铁、珠肇高铁、广州南沙港铁路。近期计划开工铁路项目3个（共73.4km）：广佛环线（佛山西站-广州北站段）、佛山经广州至东莞城际佛山段（广州地铁28号线佛山段）、广州南至广州联络线。\\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 123.00, 1660635044344, '2022-08-16 15:30:50', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
