INSERT INTO `t_system_log` VALUES ('1559473290132688898', NULL, NULL, NULL, 'testadmin', '管理员', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104791264333825\",\"title\":\"南海一汽大众工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（截止2022年7月底，服务2标负责每月更新一次）\\n一、项目总体情况\\n  广东南海一汽大众铁路专用线概算总投资6.9亿元，采用设计施工总承包（EPC）模式实施建设。线路总长1.96km（铺轨长度10.56km）、无正线，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。 主要包括以下两项建设内容：\\n  1.改造既有广珠铁路官窑站，增设到发线3条，预留1条；\\n  2.在广珠铁路官窑站北侧新建综合性货场一处，设置3束5线货物线，另预留1条。\\n  3.中标单位为中铁工程设计咨询集团有限公司；施工分包单位为中铁六局集团有限公司；监理单位为中铁一院集团南方工程咨询监理有限公司。\\n二、工程进展情况\\n  1.站场路基：新建站场路基已完成路基填筑，剩余东西咽喉区顶进涵范围的路基填筑；开累完成99%，剩余1%。\\n  2.站场附属：站场排水沟、挡土墙、浆砌片石、站场坡脚排水槽等累计完成约95%；\\n  3.跨官华路特大桥：正在进行桥面附属结构工程施工；\\n  4.站场房建：综合楼、宿舍楼已完成封顶，正在进行装饰装修；已完站场内货运综合楼、单身宿舍楼、叉车库、储油间、仓库结构柱等主体结构的施工，剩余邻近既有铁路还建接触网工区（工程车库、储油间、材料库）、整备棚、轨道衡计量室、车号识别信号探测站、红外线探测房、官窑站信号楼接建的工程施工；开累完成73%，剩余27%。\\n  5.轨道工程：站场核心区新增3 股到发线，以及货场区3束6线已完成轨道铺设；\\n 6.四电及设备工程：房建部分机电已开始施工，站场已完成部分电力线及通讯线管沟施工。\\n三、下一步计划\\n  1.2022年8月30日前完成综合楼、住宿楼装饰装修；\\n  2.2022年10月30日前完成土建工程收尾及机电设备采购、安装；\\n  3.2022年11月1日-12月30日进行静动态联调联试。\\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 122.00, 1660642374483, '2022-08-16 17:33:01', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
