INSERT INTO `t_system_log` VALUES ('1559716019467030530', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/release', 'POST', ' {\"id\":\"1555102606937919490\",\"sectionId\":\"1\",\"title\":\"全市在建项目基本情况\",\"content\":\"(截止8月8日)\\n1.全市在建城市轨道交通工程共4个项目（56个施工标段），共139km。\\n  分别为：三号线工程69.5km，四号线一期工程56km，南海新交通工程3.6km，里水有轨电车工程9.9km。\\n2.佛山境内铁路在建项目4个，共115.5Km。\\n  分别为：一汽大众铁路专用线项目、广湛高铁、珠肇高铁、广州南沙港铁路。近期计划开工铁路项目3个（共73.4km）：广佛环线（佛山西站-广州北站段）、佛山经广州至东莞城际佛山段（广州地铁28号线佛山段）、广州南至广州联络线。\\n\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 160.00, 1660700245627, '2022-08-17 09:37:32', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1559716052975325185', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/release', 'POST', ' {\"id\":\"1555102888925171713\",\"sectionId\":\"1\",\"title\":\"危大工程情况\",\"content\":\"全市轨道交通行业共70处危大工程（截止8月8日），分别为：\\n  1.城市轨道交通39处危大工程：8处深基坑、5个盾构区间(6台盾构机)、3个暗挖工程、6处高支模、16台起重设备、9处有限空间作业 ；\\n  2.省管铁路31处危大工程：4处深基坑、8处挂篮安装及移动工程、2处承重支撑体系、12处起重吊装及设备工程、2处涉水工程、3段邻近铁路营业线施工；\\n（服务1标负责每月更新一次）\\n\\n\\n\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":25}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 127.00, 1660700253649, '2022-08-17 09:37:40', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
