INSERT INTO `t_system_log` VALUES ('1559816237436997633', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/update', 'PUT', ' {\"sectionId\":\"2\",\"title\":\"全市轨道交通规划基本情况\",\"content\":\"国家铁路：途经我市的国家铁路项目共12条（段），客运车站6座，货运车站10座，总里程403.49公里。\\n城际铁路：途经我市的城际轨道交通项目7条（段），车站25座，总里程287.42公里。\\n城市轨道：2016年7月，市政府批复《佛山市城市轨道交通线网规划修编》。根据规划成果，我市规划地铁项目共14条，总长度为562公里。市自然资源局正在开展佛山市城市轨道交通线网规划修编工作并已通过专家评审，目前已向书记做专题汇报。根据现阶段规划成果，佛山市规划地铁项目共22条，总里程约761公里（后续将根据实际情况进一步调整优化）。\\n有轨电车：根据2016年7月市政府批复《佛山市城市轨道交通线网规划修编》，我市规划有轨电车项目共19条，线网总规模433.3公里。\\n\\n\",\"indexFlag\":\"6\",\"status\":\"9\",\"updateFlag\":\"3\",\"id\":\"1557547065063608321\",\"buttonType\":\"save\"}', '成功', '重要消息修改接口', '172.19.0.3', '', NULL, 280.00, 1660724139332, '2022-08-17 16:15:46', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1559816266423832577', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/release', 'POST', ' {\"id\":\"1557547065063608321\",\"sectionId\":\"2\",\"title\":\"全市轨道交通规划基本情况\",\"content\":\"国家铁路：途经我市的国家铁路项目共12条（段），客运车站6座，货运车站10座，总里程403.49公里。\\n城际铁路：途经我市的城际轨道交通项目7条（段），车站25座，总里程287.42公里。\\n城市轨道：2016年7月，市政府批复《佛山市城市轨道交通线网规划修编》。根据规划成果，我市规划地铁项目共14条，总长度为562公里。市自然资源局正在开展佛山市城市轨道交通线网规划修编工作并已通过专家评审，目前已向书记做专题汇报。根据现阶段规划成果，佛山市规划地铁项目共22条，总里程约761公里（后续将根据实际情况进一步调整优化）。\\n有轨电车：根据2016年7月市政府批复《佛山市城市轨道交通线网规划修编》，我市规划有轨电车项目共19条，线网总规模433.3公里。\\n\\n\",\"indexFlag\":\"6\",\"updateFlag\":\"3\"}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 136.00, 1660724146387, '2022-08-17 16:15:53', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
