INSERT INTO `t_system_log` VALUES ('1560162211518844929', NULL, NULL, NULL, 'testadmin', '普通用户', '/top_msg_audit/save', 'POST', ' {\"sectionId\":\"1\",\"title\":\"诚信管理\",\"content\":\"  佛山市城市轨道交通建设行业诚信管理系统累计在册企业数685家，累计登记技术管理人员8378人。其中诚信登记A级:49家，B级：634家，C级：2家（中国建筑第四工程局有限公司、铁四院（湖北）工程监理咨询有限公司），D级：0家。\\n  今年以来截至8月17日，我市轨道交通行业完成225家拟参建企业的诚信登记，对参建单位出具了63宗扣分通知书，累计诚信扣335分；依据管理办法，对参建单位申请的85宗奖励加分登记，累计诚信登记加分341分，对轨道交通工程参建企业实行差异化监管。（数据更新日期：2022年8月18日，更新人：刘攀，审核人：黎富春）\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":30}', '成功', '重要消息新增接口', '172.19.0.3', '', NULL, 180.00, 1660806626083, '2022-08-18 15:10:32', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
