INSERT INTO `t_system_log` VALUES ('1560165608628260866', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/release', 'POST', ' {\"id\":\"1555102888925171713\",\"sectionId\":\"1\",\"title\":\"危大工程情况\",\"content\":\"全市轨道交通行业共70处危大工程，分别为：\\n  1.城市轨道交通39处危大工程：8处深基坑、5个盾构区间(6台盾构机)、3个暗挖工程、6处高支模、16台起重设备、9处有限空间作业 ；\\n  2.省管铁路31处危大工程：4处深基坑、8处挂篮安装及移动工程、2处承重支撑体系、12处起重吊装及设备工程、2处涉水工程、3段邻近铁路营业线施工；\\n(数据更新日期：2022年8月8日，更新人：谢铭毅 ，审核人：刘吉武 )\\n\\n\\n\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":25}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 134.00, 1660807436061, '2022-08-18 15:24:02', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1560186074172592130', NULL, NULL, NULL, 'testadmin', '管理员', '/top_msg_audit/release', 'POST', ' {\"id\":\"1557262673254649857\",\"sectionId\":\"1\",\"title\":\"疫情防控情况\",\"content\":\"（截止8月18日）疫情防控信息：\\n  佛山市在建轨道交通工程（含城市轨道、省管铁路）共11个项目72个在建工地（施工标段），参建人员7253人，当日新进场人员20人，新进场人员都持48小时核酸检测和三天两检证明。7天内重点关注人员省外0人，省内0人。涉疫应急处置五种场景0人。全部工地均每周开展一次全员核酸检测，重点岗位人员（厨师、保安等）、非集中居住人员每周开展二次核酸检测（间隔3天）。已完成核酸检测人员7253人。全部标段均已按要求自查应急处置人员配备和物资准备情况，全部标段已开展疫情应急处置演练。\\n（服务1标负责每天更新一次）\\n\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":1}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 127.00, 1660812315435, '2022-08-18 16:45:22', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
