INSERT INTO `t_system_log` VALUES ('1565141774955024385', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1555104791264333825\",\"title\":\"南海一汽大众工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"（截止2022年8月底，服务2标负责每月更新一次）\\n一、项目总体情况\\n  广东南海一汽大众铁路专用线概算总投资6.9亿元，采用设计施工总承包（EPC）模式实施建设。线路总长1.96km（铺轨长度10.56km）、无正线，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\\n  截至目前已完成固投金额为 8300 万元，完成今年计划固\\n投金额 18000 万元的 46.11%；累计完成施工产值约 3.90 亿元，占 EPC 合同价 4.98 亿元的 78.3%。\\n 主要包括以下两项建设内容：\\n  1.改造既有广珠铁路官窑站，增设到发线3条，预留1条；\\n  2.在广珠铁路官窑站北侧新建综合性货场一处，设置3束5线货物线，另预留1条。\\n  3.中标单位为中铁工程设计咨询集团有限公司；施工分包单位为中铁六局集团有限公司；监理单位为中铁一院集团南方工程咨询监理有限公司。\\n二、工程进展情况\\n  1.站场路基：站场核心区已基本完成填筑；\\n  2.站场附属：站场排水沟、挡土墙、浆砌片石、站场坡脚\\n排水槽等已基本完成；\\n  3.跨官华路特大桥：正在进行桥面附属结构工程施工；\\n  4.站场房建：综合楼、宿舍楼已完成封顶，正在进行装饰\\n装修；\\n  5.轨道工程：站场核心区新增 3 股到发线，以及货场区 3\\n束 6 线已完成轨道铺设；\\n  6.四电及设备工程：房建部分机电已开始施工，站场已完\\n成部分电力线及通讯线管沟施工。\\n\\n \\n\",\"status\":\"9\",\"updateFlag\":\"3\"}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 236.00, 1661993846466, '2022-09-01 08:57:33', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1565141787818954753', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1555104791264333825\",\"title\":\"南海一汽大众工程\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（截止2022年8月底，服务2标负责每月更新一次）\\n一、项目总体情况\\n  广东南海一汽大众铁路专用线概算总投资6.9亿元，采用设计施工总承包（EPC）模式实施建设。线路总长1.96km（铺轨长度10.56km）、无正线，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\\n  截至目前已完成固投金额为 8300 万元，完成今年计划固\\n投金额 18000 万元的 46.11%；累计完成施工产值约 3.90 亿元，占 EPC 合同价 4.98 亿元的 78.3%。\\n 主要包括以下两项建设内容：\\n  1.改造既有广珠铁路官窑站，增设到发线3条，预留1条；\\n  2.在广珠铁路官窑站北侧新建综合性货场一处，设置3束5线货物线，另预留1条。\\n  3.中标单位为中铁工程设计咨询集团有限公司；施工分包单位为中铁六局集团有限公司；监理单位为中铁一院集团南方工程咨询监理有限公司。\\n二、工程进展情况\\n  1.站场路基：站场核心区已基本完成填筑；\\n  2.站场附属：站场排水沟、挡土墙、浆砌片石、站场坡脚\\n排水槽等已基本完成；\\n  3.跨官华路特大桥：正在进行桥面附属结构工程施工；\\n  4.站场房建：综合楼、宿舍楼已完成封顶，正在进行装饰\\n装修；\\n  5.轨道工程：站场核心区新增 3 股到发线，以及货场区 3\\n束 6 线已完成轨道铺设；\\n  6.四电及设备工程：房建部分机电已开始施工，站场已完\\n成部分电力线及通讯线管沟施工。\\n\\n \\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 98.00, 1661993849670, '2022-09-01 08:57:36', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
