INSERT INTO `t_system_log` VALUES ('1565584371146133505', NULL, NULL, NULL, 'testadmin', '普通用户', '/top_msg_audit/release', 'POST', ' {\"id\":\"1557262673254649857\",\"sectionId\":\"-1\",\"title\":\"疫情防控情况\",\"content\":\"（截止9月1日）疫情防控信息：\\n 佛山市在建轨道交通工程（含城市轨道、省管铁路）共11个项目65个在建工地（施工标段），参建人员6965人，当日新进场人员3人，新进场人员都持48小时核酸检测和三天两检证明。7天内重点关注人员省外1人，省内0人，（重点关注人员1人。四川省成都市青白江区返回1人，已向社区报备，现进行居家隔离3天和核酸检测，目前核酸检测结果均为阴性无异常情况发生）。涉疫应急处置五种场景0人。全部工地均每周开展一次全员核酸检测，重点岗位人员（厨师、保安等）、非集中居住人员每周开展二次核酸检测（间隔3天）。已完成核酸检测人员6965人。全部标段均已按要求自查应急处置人员配备和物资准备情况，全部标段已开展疫情应急处置演练。\\n（服务1标负责每天更新一次）\\n\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":1}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 136.00, 1662099369718, '2022-09-02 14:16:16', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
