INSERT INTO `t_system_log` VALUES ('1569492429966512130', NULL, NULL, NULL, 'testadmin', '普通用户', '/top_msg_audit/release', 'POST', ' {\"id\":\"1555102888925171713\",\"sectionId\":\"-1\",\"title\":\"危大工程情况\",\"content\":\"\\u003cp\\u003e全市轨道交通行业共48处危大工程（相比8月减少22处），分别为： 1.城市轨道交通30处危大工程（包含9处有限空间作业）：5处深基坑、6个盾构区间(7台盾构机)、3个暗挖工程、2处高支模、13台起重设备 ； 2.省管铁路18处危大工程：7处深基坑、5处高支模、1处起重吊装及设备工程、2处涉水工程、3段邻近铁路营业线施工； (数据更新日期：2022年9月6日，更新人：谢铭毅 ，审核人：刘吉武 )\\u003c/p\\u003e\\u003cp\\u003e\\u003cimg src\\u003d\\\"/file_service_test/download?attachmentId\\u003d1569491915522543617\\\"/\\u003e\\u003c/p\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":30}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 157.00, 1663031123530, '2022-09-13 09:05:30', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1569495907921137665', NULL, NULL, NULL, 'testadmin', '普通用户', '/top_msg_audit/release', 'POST', ' {\"id\":\"1560162185715486721\",\"sectionId\":\"-1\",\"title\":\"全市诚信管理情况\",\"content\":\"\\u003cp style\\u003d\\\"text-align: center;\\\"\\u003e  \\u003cimg src\\u003d\\\"/file_service_test/download?attachmentId\\u003d1569495626579808257\\\" width\\u003d\\\"491\\\"/\\u003e\\u003c/p\\u003e\\u003cp\\u003e佛山市城市轨道交通建设行业诚信管理系统累计在册企业数685家，累计登记技术管理人员8378人。其中诚信登记A级:49家，B级：634家，C级：2家（中国建筑第四工程局有限公司、铁四院（湖北）工程监理咨询有限公司），D级：0家。 今年以来截至8月17日，我市轨道交通行业完成225家拟参建企业的诚信登记，对参建单位出具了63宗扣分通知书，累计诚信扣335分；依据管理办法，对参建单位申请的85宗奖励加分登记，累计诚信登记加分341分，对轨道交通工程参建企业实行差异化监管。（数据更新日期：2022年8月18日，更新人：刘攀，审核人：黎富春）\\u003c/p\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":30}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 147.00, 1663031952726, '2022-09-13 09:19:19', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
