INSERT INTO `t_system_log` VALUES ('1569892120772317186', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1565625766342922242\",\"title\":\"总体情况\",\"sectionId\":\"1\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"（截止2022年9月7日，服务1标负责每月更新一次）\\n目前我市在建城市轨道交通工程项目共4个，共139km：三号线工程69.5km、四号线一期工程56km、南海新交通工程3.6km、里水有轨电车9.9km。\\n  佛山市境内在建省管铁路项目4个，共115.5Km：为一汽大众铁路专用线项目、广湛高铁、珠肇高铁、广州南沙港铁路。\\n一、城市轨道交通工程\\n  目前全市共5个项目在施工（56个施工标段）；共有30处危大工程（其中5个深基坑、7个盾构区间、3个暗挖工程、2处高支模、13台门式起重设备），有限空间作业9处。重大风险管控项目11个（全部在三号线，其中一级管控8个、二级管控3个)。其中一级风险总数对比8月份增加1处，（其中新增中山公园站附属结构、大科暗挖区间各1处，火车站附属结构销号1处）。\\n二、省管铁路\\n  1.省管铁路（佛山段）目前在建4个项目（7个施工标段），共有5处高风险工点均在广湛高铁 。\\n  2.省管铁路8月份危大工程共18处，具体如下：\\n  2.1.基坑工程7处：（珠肇高铁GZZQ-1标1处（高明河特大桥左线20#墩）、珠肇高铁JJZQ-6标1处（跨广明高速56#墩）、广湛高铁GZZQ-3标5处（212#、214#、225#、226#、238#墩））；\\n  2.2.挂篮安装及移动工程4处：（（广珠广茂联络线下行线跨广三高速公路55-58#墩（62+112+62）m连续梁1处、广珠广茂联络线上行线69-72#墩（40+56+40）m连续梁挂篮拆除1处、佛山特大桥连续梁193#墩2处）；\\n  2.3.承重支撑体系1处：广珠广茂联络线上行线120m系杆拱桥1处；\\n  2.4.起重吊装及设备工程1处：拆除1台架桥机；\\n  2.5.水上作业工程2处：（跨东平水道桥水上栈桥及双壁钢围堰施工、跨西江桥水上栈桥及钢围堰施工）：\\n  2.6.邻近营业线3段，存在影响铁路运营安全风险的路基施工：（广珠广茂联络线路基的共线段、上行线及下行线）。\\n\\n\\n\\n\",\"status\":\"9\",\"updateFlag\":\"6\",\"updateRate\":30}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 249.00, 1663126417151, '2022-09-14 11:33:43', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
