INSERT INTO `t_system_log` VALUES ('1571703280706359297', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1565627239025971201\",\"title\":\"二号线\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"佛山市城市轨道交通2号线一期工程已于2021年12月28日正式通车，甩项工程8 项：\\n  1.湾华站：湾华站电扶梯已通过验收；\\n  2.湾华联络线施工完毕已通过验收。\\n  3.湖涌站：A2出入口施工完毕，人行天桥附属设施正进行施工。\\n  4.南庄站：A出入口施工完毕，等待验收。\\n  5.广州南站：换乘通道及应急疏散口暂不具备施工条件。\\n  6.张槎站：换乘通道及地下空间环形道路暂不具备施工条件。\\n  7.湾华控制中心：线网指挥中心方案待定。\\n  8.石湾主变电所景观平台。\\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 119.00, 1663558231462, '2022-09-19 11:30:38', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
