INSERT INTO `t_system_log` VALUES ('1572427713007947777', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1572427612734722049\",\"title\":\"规划总体情况\",\"sectionId\":\"2\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"国家铁路：途经我市的国家铁路项目共12条（段），总里程403.49公里。\\n城际铁路：途经我市的城际轨道交通项目7条（段），总里程287.42公里。\\n城市轨道：2016年7月，市政府批复《佛山市城市轨道交通线网规划修编》。根据规划成果，我市规划地铁项目共14条，总长度为562公里。市自然资源局正在开展佛山市城市轨道交通线网规划修编工作并已通过专家评审，目前已向书记做专题汇报。根据现阶段规划成果，佛山市规划地铁项目共22条，总里程约761公里（后续将根据实际情况进一步调整优化）。\\n有轨电车：根据2016年7月市政府批复《佛山市城市轨道交通线网规划修编》，我市规划有轨电车项目共19条，线网总规模433.3公里。\",\"status\":\"3\",\"updateFlag\":\"3\"}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 186.00, 1663730949513, '2022-09-21 11:29:16', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1572427758172213250', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572427612734722049\",\"title\":\"规划总体情况\",\"sectionId\":\"2\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"国家铁路：途经我市的国家铁路项目共12条（段），总里程403.49公里。\\n城际铁路：途经我市的城际轨道交通项目7条（段），总里程287.42公里。\\n城市轨道：2016年7月，市政府批复《佛山市城市轨道交通线网规划修编》。根据规划成果，我市规划地铁项目共14条，总长度为562公里。市自然资源局正在开展佛山市城市轨道交通线网规划修编工作并已通过专家评审，目前已向书记做专题汇报。根据现阶段规划成果，佛山市规划地铁项目共22条，总里程约761公里（后续将根据实际情况进一步调整优化）。\\n有轨电车：根据2016年7月市政府批复《佛山市城市轨道交通线网规划修编》，我市规划有轨电车项目共19条，线网总规模433.3公里。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 97.00, 1663730960372, '2022-09-21 11:29:27', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
