INSERT INTO `t_system_log` VALUES ('1572428020463013890', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/update', 'PUT', ' {\"id\":\"1572427862312587266\",\"title\":\"深南高铁珠三角枢纽机场至省界段\",\"sectionId\":\"2\",\"hidden\":\"0\",\"icon\":\"\",\"content\":\"高铁项目，途经佛山（高明）、肇庆、云浮三市，全长约141.616公里，佛山境内约5.838公里，项目接入珠三角枢纽机场站。项目于2021年3月15日召开了预可研评审，于2021年11月22日-24日召开了工可评审，于2022年1月19日至20日召开了工可鉴修，目前正在开展社会稳定风险分析、征地拆迁框架协议签署等工程可行性研究前期工作，计划2022年内取得可研批复，力争2022年底前先行段开工建设。\",\"status\":\"3\",\"updateFlag\":\"3\"}', '成功', '修改当前子菜单', '172.19.0.3', '', NULL, 180.00, 1663731022822, '2022-09-21 11:30:29', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
