INSERT INTO `t_system_log` VALUES ('1572428422361223170', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428349132869634\",\"title\":\"柳广铁路\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"普速铁路项目。线路西起柳州市，向东经广西来宾市、贵港市、梧州市至广东省肇庆市和广州市。线路设计全长415公里,其中大湾区内（广东省境内）里程230.41公里,我市境内预计约31.93公里，佛山段总投资约33.46亿元，预计在我市设置一座南边站（客货两用），项目已启动预可研工作，计划“十四五”期间动工。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 103.00, 1663731118720, '2022-09-21 11:32:05', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
