INSERT INTO `t_system_log` VALUES ('1572428488463454210', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428429034360833\",\"title\":\"广佛环线城际（佛山西站至广州北站段）\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"广佛环线佛山西站至广州北站段线路自佛山西站城际场引出，经狮山、里水、炭步、江高，止于广州北站城际场。除佛山西站和广州北站外，全长约47.01公里，佛山境内约30.5公里，新设狮山东站、大榄站、官窑南站、和桂站4个客运车站（未计算佛山西站）。项目总投资228.06亿元，佛山段总投资估算约157.92亿元。项目工可已于2021年11月26日获批，项目初步设计已于2022年5月31日获批，省要求项目于2022年内开工建设。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 95.00, 1663731134489, '2022-09-21 11:32:21', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1572428523695607810', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/add', 'POST', ' {\"title\":\"佛山经广州至东莞城际\",\"sectionId\":\"2\"}', '成功', '新增子菜单', '172.19.0.3', '', NULL, 175.00, 1663731142809, '2022-09-21 11:32:29', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1572428559921811457', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428497909026817\",\"title\":\"佛山经广州至东莞城际\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"线路全长约113公里，佛山境内约25.7公里，我市境内设10座车站，分别是三眼桥站、奇槎站、海八路站、叠滘站、普君北路站、人民公园站、文华公园站、澜石二路站、东平站、鹭洲站。项目总投资1140.6亿元，佛山段投资289亿元。目前，项目正在开展工程可行性研究等前期工作，计划于2022年8月16-17日召开项目工程可行性研究报告技术咨询专家评审会议。广州市希望本项目2022年底前开工建设。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 102.00, 1663731151517, '2022-09-21 11:32:38', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1572428588510187521', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/add', 'POST', ' {\"title\":\"肇顺南城际\",\"sectionId\":\"2\"}', '成功', '新增子菜单', '172.19.0.3', '', NULL, 176.00, 1663731158261, '2022-09-21 11:32:44', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1572428629064912898', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428562723606530\",\"title\":\"肇顺南城际\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"线路全长约150公里，佛山境内约89.2公里。项目总投资525亿元，佛山段投资224亿元。如按照城际方案，初步计划设置珠三角枢纽机场站、明城站、高明站、九江站、龙江站、龙潭站、马岗站、德胜站、顺德学院站合计9座。如按照高铁方案，初步计划设置珠三角枢纽机场站、高明站、龙江站、顺德学院站合计4座。肇顺南城际的功能定位有待进一步明确，广佛肇三市将争取项目提升为干线铁路并担任深南高铁的通道之一。项目正在开展前期研究工作，建议结合项目建设必要性和我市财政能力，综合评估项目建设时序，“十四五”期间以项目线站位方案研究和通道控制为主。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 96.00, 1663731168009, '2022-09-21 11:32:54', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1572428660689965057', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/add', 'POST', ' {\"title\":\"广佛江珠城际\",\"sectionId\":\"2\"}', '成功', '新增子菜单', '172.19.0.3', '', NULL, 178.00, 1663731175468, '2022-09-21 11:33:02', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1572428698346426370', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428634899189762\",\"title\":\"广佛江珠城际\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"线路全长约88公里，佛山境内约46.9公里。按照2017年编制的工可方案和初步设计方案，计划设置三眼桥站、南海站、顺德北站、乐从站、龙江站合计5座。目前，项目东平新城-江门三江段（该段总投资约452.52亿，总里程约74.8公里，我市境内约24.25公里，我市境内投资约166.5亿），正在启动线站位方案研究等前期工作，初定在我市境内设置顺德北站、乐从、龙江北、龙江4座车站，并于2022年6月22日召开项目预可研审查。江门市希望广佛江珠城际顺德北站-江门段于2022年底取得可研批复，2023年6月开工建设。建议结合项目建设必要性和我市财政能力，综合评估项目建设时序，“十四五”期间以项目线站位方案研究和通道控制为主。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 107.00, 1663731184517, '2022-09-21 11:33:11', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
