INSERT INTO `t_system_log` VALUES ('1572428768483577858', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428705447383041\",\"title\":\"佛山轨道交通2号线二期\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"线路起于高明区西安站，途径荷城街道、西樵镇，止于禅城区南庄站，线路长约23.5公里，设车站10座。项目总投资122.28亿元，计划2022年动工建设。目前市铁投集团正在同步组织开展项目工可报告及相关配套专题的编制工作。勘察设计总承包已完成招标，正启动开展总体设计和初步勘察设计工作。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 95.00, 1663731201251, '2022-09-21 11:33:27', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
