INSERT INTO `t_system_log` VALUES ('1572428814797082625', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428766667444225\",\"title\":\"佛山轨道交通11号线一期\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"线路起于顺德区容奇渡口站，途径大良街道、伦教街道、北滘镇、陈村镇、三山新城，止于荔湾区鹤洞东站，根据项目可研阶段性成果，线路长约36.4公里（佛山段32.4公里，广州段4公里），设车站18座（佛山段16座，广州段2座）。项目总投资310.51亿元，其中佛山段总投资271.21亿元，计划2021年动工建设。目前，全线总平面方案已基本稳定，初步设计文件已基本完成。广佛两市正积极开展项目广州段舆情化解工作。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 96.00, 1663731212265, '2022-09-21 11:33:38', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
