INSERT INTO `t_system_log` VALUES ('1572852829525217281', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428705447383041\",\"title\":\"2号线二期\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"线路起于高明区西安站，途径荷城街道、西樵镇，止于禅城区南庄站，线路长约23.5公里，设车站10座。项目总投资122.28亿元，计划2022年动工建设。目前市铁投集团正在同步组织开展项目工可报告及相关配套专题的编制工作。勘察设计总承包已完成招标，正启动开展总体设计和初步勘察设计工作。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 123.00, 1663832305252, '2022-09-22 15:38:31', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1572853447664963585', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428497909026817\",\"title\":\"佛莞城际\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"线路全长约113公里，佛山境内约25.7公里，我市境内设10座车站，分别是三眼桥站、奇槎站、海八路站、叠滘站、普君北路站、人民公园站、文华公园站、澜石二路站、东平站、鹭洲站。项目总投资1140.6亿元，佛山段投资289亿元。目前，项目正在开展工程可行性研究等前期工作，计划于2022年8月16-17日召开项目工程可行性研究报告技术咨询专家评审会议。广州市希望本项目2022年底前开工建设。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 163.00, 1663832452588, '2022-09-22 15:40:59', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
