INSERT INTO `t_system_log` VALUES ('1572856665174282241', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1572428215493955586\",\"title\":\"（广南联络）广州站至广州南站联络线\",\"sectionId\":\"2\",\"hidden\":\"0\",\"content\":\"高速铁路枢纽联络线工程项目，总投资76亿元，佛山段总投资28亿元，全长约15.633公里，佛山境内约4.45公里，未设置站点。项目可研预计2022年8月底前获批，省要求项目于2022年内动工建设。\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 126.00, 1663833219739, '2022-09-22 15:53:46', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
