INSERT INTO `t_system_log` VALUES ('1573111499953639426', NULL, NULL, NULL, 'testadmin', '普通用户', '/top_msg_audit/release', 'POST', ' {\"id\":\"1555102888925171713\",\"sectionId\":\"-1\",\"title\":\"危大工程情况\",\"content\":\"\\u003cp\\u003e\\u003cspan style\\u003d\\\"color: rgb(230, 0, 0);\\\"\\u003e全市轨道交通行业共48处危大工程（相比8月减少22处），分别为：\\u003c/span\\u003e\\u003c/p\\u003e\\u003cp\\u003e\\u003cspan style\\u003d\\\"color: rgb(230, 0, 0);\\\"\\u003e1.城市轨道交通30处危大工程（包含9处有限空间作业）：5处深基坑、6个盾构区间(7台盾构机)、3个暗挖工程、2处高支模、13台起重设备 ；\\u003c/span\\u003e\\u003c/p\\u003e\\u003cp\\u003e\\u003cspan style\\u003d\\\"color: rgb(230, 0, 0);\\\"\\u003e2.省管铁路18处危大工程：7处深基坑、5处高支模、1处起重吊装及设备工程、2处涉水工程、3段邻近铁路营业线施工；\\u003c/span\\u003e\\u003c/p\\u003e\\u003cp\\u003e(数据更新日期：2022年9月6日，更新人：谢铭毅 ，审核人：刘吉武 )\\u003c/p\\u003e\\u003cp\\u003e\\u003cimg src\\u003d\\\"/file_service_test/download?attachmentId\\u003d1569491915522543617\\\"/\\u003e\\u003c/p\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":30}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 162.00, 1663893977047, '2022-09-23 08:46:23', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
