INSERT INTO `t_system_log` VALUES ('1574282903470313473', NULL, NULL, NULL, 'testadmin', '普通用户', '/top_msg_audit/release', 'POST', ' {\"id\":\"1557262673254649857\",\"sectionId\":\"-1\",\"title\":\"疫情防控情况\",\"content\":\"\\u003cp\\u003e\\u003cspan class\\u003d\\\"ql-size-large\\\"\\u003e\\u003cimg src\\u003d\\\"/file_service_test/download?attachmentId\\u003d1569484242391502849\\\"/\\u003e \\u003c/span\\u003e\\u003c/p\\u003e\\u003cp\\u003e\\u003cspan class\\u003d\\\"ql-size-large\\\"\\u003e佛山市在建轨道交通工程（含城市轨道、省管铁路）共11个项目60个在建工地（施工标段），参建人员6995人，当日新进场人员0人，新进场人员都持48小时核酸检测和三天两检证明。7天内重点关注人员省外0人，省内2人（四号线4202标9月22日下午疫情排查发现两个工人被赋红码，目前已被医护车接走到云东海戈登隔离酒店集中隔离三天，核酸检测情况正常）。涉疫应急处置五种场景0人。防疫培训，线上0人，线下0人。全部工地均每周开展一次全员核酸检测，重点岗位人员（厨师、保安等）、非集中居住人员每周开展二次核酸检测（间隔3天）。已完成核酸检测人员6995人。全部标段均已按要求自查应急处置人员配备和物资准备情况，全部标段已开展疫情应急处置演练。\\u003c/span\\u003e\\u003c/p\\u003e\\u003cp\\u003e\\u003cspan class\\u003d\\\"ql-size-large\\\"\\u003e (数据更新日期：2022年9月25日，更新人：潘玲，审核人：曾幸波) （服务1标负责每天更新一次）\\u003c/span\\u003e\\u003c/p\\u003e\",\"indexFlag\":\"6\",\"updateFlag\":\"6\",\"updateRate\":1}', '成功', '重要消息发布接口', '172.19.0.3', '', NULL, 147.00, 1664173261426, '2022-09-26 14:21:08', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
