INSERT INTO `t_system_log` VALUES ('1574283940105129985', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/cancelAudit', 'POST', ' {\"id\":\"1565627498531753985\",\"title\":\"四号线\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（截止2022年8月底，由服务2标每月更新）\\n一、项目总体情况\\n  佛山市城市轨道交通四号线一期西起三水区北江大道站，东至南海区港口路站，全长55.22km，其中地下段49.14km，过渡段0.82km，高架段5.26km。共设33座车站（地下站30座、高架站3座），其中换乘站14座，平均站间距约1.71km。设平胜车辆段和大堕山停车场、湾华控制中心，设三水主变、绿岛湖主变和平洲主变。最高运行速度为100km/h 。\\n二、工程进展情况\\n  目前四号线一期工程进场共4 个标段、共6 个车站，4 个车站进行交通疏解、围蔽区域内绿化迁改、管线迁改、地质勘探工作、交通导改及临时围蔽等施工准备工作，2 个车站进行围护结构钻孔桩施工。\\n\",\"updateFlag\":\"3\"}', '成功', '取消审核', '172.19.0.3', '', NULL, 161.00, 1664173508567, '2022-09-26 14:25:15', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
INSERT INTO `t_system_log` VALUES ('1574284843092643842', NULL, NULL, NULL, 'testadmin', '普通用户', '/section_menu_audit/release', 'POST', ' {\"id\":\"1565627498531753985\",\"title\":\"四号线\",\"sectionId\":\"1\",\"hidden\":\"0\",\"content\":\"（截止2022年8月底，由服务2标每月更新）\\n一、项目总体情况\\n  佛山市城市轨道交通四号线一期西起三水区北江大道站，东至南海区港口路站，全长55.22km，其中地下段49.14km，过渡段0.82km，高架段5.26km。共设33座车站（地下站30座、高架站3座），其中换乘站14座，平均站间距约1.71km。设平胜车辆段和大堕山停车场、湾华控制中心，设三水主变、绿岛湖主变和平洲主变。最高运行速度为100km/h 。\\n二、工程进展情况\\n  土建工程部分：全线车站33座，目前2个车站进行交通疏解、围蔽区域内绿化迁改、路灯迁改、交通导改及临时围蔽等施工准备工作，2个进行主体结构桩基础、围护结构施工围护结构钻孔桩施工，2个现场未施工，3个未进场施工。全线区间34个，均未进入施工阶段。停车场1个、车辆段1个、出入场线1个，均未招标。\\n三、质量安全总体概述\\n  8月份，监督服务部对4个标段开展了日常监督检查4次。检查人员27人次，下发工程质量安全整改通知书3份，形成监督检查记录4份，提出质量安全问题共计26条，其中安全问题15条，占比58%；质量问题1条，占比4%；管理行为问题10条，占比38%。\\n  通过检查对比，安全问题、质量问题、管理行为问题总体均呈下降趋势，其中管理行为问题显著好转。根据日常监督检查抽检情况，四号线一期工程土建工程施工质量安全处于总体可控状态。\\n\",\"updateFlag\":\"3\"}', '成功', '发布子菜单', '172.19.0.3', '', NULL, 99.00, 1664173723916, '2022-09-26 14:28:50', '1544145698858913794', '普通用户', NULL, NULL, NULL, 0);
