INSERT INTO `t_top_msg` VALUES ('1555101483011248130', '-1', '三号线工程', '（1）项目总体情况\n佛山市城市轨道交通三号线南起顺德客运港站，北至科技学院站，为贯通佛山市南北的主干线，线路全长约为69.5公里，总投资425.72亿元。三号线共设37座车站（有4个车站已纳入其它线路同步实施)，高架车站3座，地下车站34座，全线设置1段2场，4座主变，1座控制中心。\n（2）工程进展情况\n投资完成情况：项目自2016年11月18日开工，截止至6月30日，三号线开累完成投资299.21亿元，占总投资425.72亿元的70.28%；其中2022年计划投资额为26亿元，截至2022年6月底，已完成投资额约23.50亿元（本月完成4.16亿元），完成年度计划90.40%，能较好地完成市委市政府关于“重点项目投资要按照每月增长10％的进度推进，确保在上半年完成投资计划完成率60％以上”的任务要求。\n土建工程部分：全线38个车站实现34个车站主体结构封顶、2座进入主体结构施工（叠滘、南海大学城站）、2座未招标（顺德港、佛山高铁站）；全线37个区间实现29个区间（含出入场线）双线洞通、剩余6个区间9台盾构机正在掘进施工（3个单线贯通），1个区间（南海大学城站至佛科院仙溪校区站）未开始掘进，1个区间（顺德港站至顺德学院站）未招标；全线159个车站出入口及风亭，已完成122个、18个正在施工、19个待开始；全线67个联络通道，51个已贯通、4个正在进行施工,12个待开始。首通段联络通道已全部完成施工。\n机电工程部分：全线38个车站，27个车站机电工程进场施工；1段2场中2个停车场机电施工基本完成，狮山车辆段总体施工完成约95%；4座主变电所中3个已完成送电并临时三权移交运营，剩余文昌主所正进行主体结构施工；正线区间强电、弱电、通信、信号、铺轨等系统工程工作面主要集中在首通段，且已基本完成（剩余部分受土建施工进度影响，暂无工作面）。\n（三）首通段（顺德学院站～镇安站）工作推进情况\n按市委、市政府有关工作要求，2022年年底应实现三号线首通段开通试运行。为更快更好地满足市民便捷出行的需求，经我局与市铁投集团会商，力争2022年年底实现三号线首通段开通初期运营目标。\n三号线首通段开通范围为顺德学院站～镇安站，包含22座车站、逢沙停车场、北滘停车场、夏园主变电所、岳步主变电所，正线开通里程约40.72公里。\n各节点计划及推进情况详见附件2。\n1.工程建设情况\n土建工程部分：首通段区间全部贯通；22个车站主体结构全部完成，95个车站出入口及风亭已完成92个、剩余3个均在施工中；联络通道已全部完成施工。\n机电工程部分：首通段已完成轨通、电通，除三北和北高区间外，热滑已完成；22个车站装修完成率超94%，11个车站已基本施工完成并临时三权移交运营；夏园主变电所、岳步主变电所已完成送电并临时三权移交运营；逢沙停车场施工进入收尾阶段，热滑完成、17列电客车接入，北滘停车场施工进入收尾阶段，热滑完成、5列电客车接入；31辆电列车中27列出厂验收完成、22列电客车到位、16列动调完成。\n2.市政配套、公交接驳等项目工作情况\n首通段6个站点须尽快完善市政配套设施，其中2个站点（顺德学院站、顺德一中站）未启动招标、1个站点（环市北站）市政配套正进行施工招标，3个站点（潭洲会展站、岳步站和岳步主所）市政配套正在实施；其余16个站点外均有市政道路配套，须完成慢行接驳和绿化配套。\n首通段17个车站周边已具备公交配套，目前正在开展公交线路方案规划研究，完善公交接驳方案；5个车站外无公交线路，目前正在开展线路方案研究。\n3.工程质量验收、专项验收工作情况\n首通段共计单位（子单位）工程128个，截止2022年7月8日，已完成68个正式验收，13个预验收。其中土建共计62个，累计通过正式验收52个，通过预验收0个；机电共计66个，累计通过正式验收16个，通过预验收13个。\n其他12个专项验收工作，除建设用地规划许可证和工程规划验收受影响外，其余专项验收工作均正常推进。\n（四）后通段（镇安站～佛科院仙溪校区站）建设管理情况\n三号线后通段15座车站除叠滘站及南海大学城站外均已封顶，正在开展内部结构及出入口附属结构施工，5座车站已移交站后机电施工；14个区间已双线贯通7个、单线贯通3个，剩余9台盾构正在掘进，掘进比例平均67%；2个区间已完成短轨通。狮山车辆段生产维修楼已完成，运用库完成91%，检修库完成91%。博爱路主变电所已投产送电，文昌主变电所完成主楼桩基施工。\n<div><br></div>', 3, '3', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:01:01', 'superadmin', '超管', '2022-08-10 08:52:20', '1544145698858913794', '普通用户', 4);
INSERT INTO `t_top_msg` VALUES ('1555101751257960449', '-1', '4号线工程', '（1）项目总体情况\n佛山市城市轨道交通四号线一期西起三水区北江大道站，东至南海区港口路站，全长55.22km，其中地下段49.14km，过渡段0.82km，高架段5.26km。共设33座车站（地下站30座、高架站3座），其中换乘站14座，平均站间距约1.71km。设平胜车辆段和大堕山停车场、湾华控制中心，设三水主变、绿岛湖主变和平洲主变。最高运行速度为100km/h 。\n（2）工程进展情况\n截止2022年6月底，\n<div><br></div>', 4, '3', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:02:05', 'superadmin', '超管', '2022-08-10 08:52:20', '1544145698858913794', '普通用户', 5);
INSERT INTO `t_top_msg` VALUES ('1555101905511878657', '-1', '全市轨道交通运营线路基本情况', '目前我市运营的城市轨道交通线路共5条，分别为地铁广佛线、地铁2号线一期、广州地铁7号线一期西延顺德段、南海区新型公共交通首通段及高明区有轨电车示范线首通段，佛山境内运营里程81.7km（其中地铁65.6km、有轨电车16.1km）。\n<div><br></div>', 5, '3', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:02:41', 'superadmin', '超管', '2022-08-10 14:08:44', '1544145698858913794', '普通用户', 6);
INSERT INTO `t_top_msg` VALUES ('1555102087590809601', '-1', '工程质量验收情况', '（服务2标负责每月更新一次）\n佛山地铁二号线一期工程：已于2021年12月28日通车，目前剩余8个甩项工程。\n佛山市城市轨道交通三号线工程首通段：共有单位（子单位）工程128个，截至2022年7月16日正式验收子单位工程73个，单位工程21个，共计正式验收完成94/128个单位（子单位）工程，预验收完成103/128个单位（子单位）工程。\n七号线工程顺德段：.已于2021年5月1日通车。', 4, '3', '9', '6', 30, '2022-09-03 16:08:32', 1, NULL, '1', '2022-08-04 16:03:25', 'superadmin', '超管', NULL, NULL, NULL, 7);
INSERT INTO `t_top_msg` VALUES ('1555102245556686850', '-1', '里水有轨电车工程', '（1）项目总体情况\n广东南海一汽大众铁路专用线线路总长1.96km（铺轨长度10.56km）、无正线，概算总投资6.9亿元，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\n（2）工程进展情况\n截止2022年6月底，全线37个车站实现35个车站主体结构封顶；全线36个盾构区间实现23个区间，目前7个区间11台盾构机正在掘进施工；全线176个出入口（风亭）实现36个封顶；全线63个联络通道（废水泵房），完成33个。\n目前21个车站整站移交机电安装，15个车站分区移交机电安装；6个铺轨基地接管，31个区间接管（包含左右线）；2个停车场、1个车辆段移交。 \n<div><br></div>', 7, '3', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:04:02', 'superadmin', '超管', '2022-08-10 08:52:20', '1544145698858913794', '普通用户', 8);
INSERT INTO `t_top_msg` VALUES ('1555102347318890497', '-1', '南海新交通工程', '（1）项目总体情况\n南海区新型公共交通系统试验段工程线路全长13.1km，概算总投资44.1亿元，其中地下线3.681km，高架线7.626km，地面线1.888km，过渡段0.280km,全线设15个站（地下站4座、地面站3座、高架站8座），投资44.1亿元。\n（2）工程进展情况\n截止2022年6月底，全线37个车站实现35个车站主体结构封顶；全线36个盾构区间实现23个区间，目前7个区间11台盾构机正在掘进施工；全线176个出入口（风亭）实现36个封顶；全线63个联络通道（废水泵房），完成33个。\n目前21个车站整站移交机电安装，15个车站分区移交机电安装；6个铺轨基地接管，31个区间接管（包含左右线）；2个停车场、1个车辆段移交。 \n<div><br></div>', 8, '3', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:04:27', 'superadmin', '超管', '2022-08-10 08:52:20', '1544145698858913794', '普通用户', 9);
INSERT INTO `t_top_msg` VALUES ('1555102504651427842', '-1', '南海一汽大众工程', '（1）项目总体情况\n广东南海一汽大众铁路专用线线路总长1.96km（铺轨长度10.56km）、无正线，概算总投资6.9亿元，线路等级为III级，位于国铁I级广珠线官窑站北侧，站线与国铁广珠线的官窑站两端接轨。\n（2）工程进展情况\n截止2022年6月底，全线37个车站实现35个车站主体结构封顶；全线36个盾构区间实现23个区间，目前7个区间11台盾构机正在掘进施工；全线176个出入口（风亭）实现36个封顶；全线63个联络通道（废水泵房），完成33个。\n目前21个车站整站移交机电安装，15个车站分区移交机电安装；6个铺轨基地接管，31个区间接管（包含左右线）；2个停车场、1个车辆段移交。 \n<div><br></div>', 9, '3', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:05:04', 'superadmin', '超管', '2022-08-10 08:52:20', '1544145698858913794', '普通用户', 10);
INSERT INTO `t_top_msg` VALUES ('1555102606937919490', '-1', '全市在建项目基本情况', '1.全市在建城市轨道交通工程共4个项目（56个施工标段），共139km。\n  分别为：三号线工程69.5km，四号线一期工程56km，南海新交通工程3.6km，里水有轨电车工程9.9km。\n2.佛山境内铁路在建项目4个，共115.5Km。\n  分别为：一汽大众铁路专用线项目、广湛高铁、珠肇高铁、广州南沙港铁路。近期计划开工铁路项目3个（共73.4km）：广佛环线（佛山西站-广州北站段）、佛山经广州至东莞城际佛山段（广州地铁28号线佛山段）、广州南至广州联络线。\n(数据更新日期：2022年8月8日，更新人：谢铭毅 ，审核人：刘吉武 )\n<div><br></div>', 1, '6', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:05:29', 'superadmin', '超管', '2022-08-18 15:23:04', '1544145698858913794', '普通用户', 2);
INSERT INTO `t_top_msg` VALUES ('1555102739792498690', '-1', '省管铁路', '（1）项目总体情况\n    1.广州至湛江铁路工程GZZQ-2标工程概况：广湛铁路位于广东省境内,线路自广州枢纽广州站引出,沿途经过广州、佛山、肇庆、云浮、阳江、茂名、湛江等市,终至规划湛江北站。我司负责的范围是广湛铁路站前二标工程,施工内容包括三部分:一是位于佛山市禅城区和南海区境内,长度10.448km(含街边站改和改建广茂线线路长度2.1km )的正线工程;二是位于佛山市三水区,连接广茂铁路与广珠铁路的新建广茂至广珠上、下行联络线工程,上下行长度分别为4.954km、4.779km:三是位于广州市白云区江高镇,线路长度3.627km的新建连接广珠铁路至京广三线的客车联络线工程。联络线计划开通日期2022年6月30日;正线计划施工总工期47.7个月,计划开工日期2020年1l月10日,竣工日期2024年10月30日。本标段合同总造价19.3884亿元,其中:联络线及街边站改建工程9.8523亿元,正线工程9.5361亿元。\n2.广州至湛江铁路工程GZZQ-3标工程概况：新建广州至湛江高速铁路站前工程GZZQ-3标段，里程范围DK34+675.57~DK50+328.089,线路长度15.652km,全部为桥梁段。线路位于佛山市南海区、三水区和高明区境内,线路起于佛山特大桥跨东平水道斜拉桥桥头DK34+675.57,上跨东平水道、国道G359、国道G240、广珠货运铁路、沈海高速公路和西江,终至标段终点佛山特大桥桥尾DK50+328.089。本标段设特大桥1座,即佛山特大桥80#墩~湛方台段。下部结构共4006根桩基,423个墩台,上部结构包括双线简支预制梁356孔(24m双线简支梁42孔,32m双线简支梁311孔,非标简支梁3孔);特殊梁跨21处,其中常规连续梁18处,(67.5+60+60+350+60+60+67.5m)钢混混合结合梁斜拉桥1处,(109+200+200+109)m钢混混合连续刚构1处,96m简支拱1处。总工期:2020年11月10日-2024年10月31日,共47.7个月。工程总造价:243215万元。\n3、广珠广茂联络线：广珠广茂上、下行联络线于既有广珠铁路K35+800处新建三江口线路所以18#道岔引出，分别跨越二广高速公路和广海大道，下行线下穿广珠铁路后，分别于既有广茂铁路K45+850和K46+950处新建三水线路所以18#道岔接入。特大桥共2座，预制简支T梁161孔。设置特殊梁跨6 处，其中连续梁4处，钢桁梁1处，简支拱1处。\n佛山市初步设计已批复范围内，佛山市境内包括正线工程和广茂至广珠上、下行联络线工程。正线起自佛山站（不含）大里程端DK24+300，出站沿既有广茂线通道向西，下钻佛开高速公路和禅西大道后，分别跨越佛罗路、佛清从高速公路、东平水道、沈海高速公路、广珠铁路和西江后，终至佛山特大桥桥尾DK50+328.089，全线沿途经过佛山市禅城区、南海区、三水区和高明区，线路长度26.102km，桥梁长度23.664km，桥隧比90.66%。其中：\n禅城区境内0.458km，均以路基形式通过。\n南海区境内19.937km，桥梁长度17.499km，桥隧比87.78%。\n三水区境内4.542km，均以桥梁形式通过。\n高明区境内1.165km，均以桥梁形式通过。\n（2）工程进展情况（截止2022年6月底）\n1、广珠广茂联络线上行线特大桥开累完成桩基础386根，完成总量428根的90.1%；承台58个，完成总量85个的68.2%；墩身50个，完成总量的58.8%。\n广珠广茂联络线下行线特大桥开累完成桩基础375根，完成总量437根的85.8%；承台55个，完成总量91个的60.4%；墩身46个，完成总量的50.5%。\n广珠广茂联络线上行线跨西江引水工程中桥开累完成桩基础12根，完成总量12根的100%；承台0个，完成总量2个的0%；台身0个，完成总量的0%。\n<div><br></div>', 10, '3', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:06:00', 'superadmin', '超管', '2022-08-10 08:52:20', '1544145698858913794', '普通用户', 2);
INSERT INTO `t_top_msg` VALUES ('1555102888925171713', '-1', '危大工程情况', '<p><span style=\"color: rgb(230, 0, 0);\">全市轨道交通行业共48处危大工程（相比8月减少22处），分别为：</span></p><p><span style=\"color: rgb(230, 0, 0);\">1.城市轨道交通30处危大工程（包含9处有限空间作业）：5处深基坑、6个盾构区间(7台盾构机)、3个暗挖工程、2处高支模、13台起重设备 ；</span></p><p><span style=\"color: rgb(230, 0, 0);\">2.省管铁路18处危大工程：7处深基坑、5处高支模、1处起重吊装及设备工程、2处涉水工程、3段邻近铁路营业线施工；</span></p><p>(数据更新日期：2022年9月6日，更新人：谢铭毅 ，审核人：刘吉武 )</p><p><img src=\"/file_service_test/download?attachmentId=1569491915522543617\"/></p>', 5, '6', '9', '6', 30, '2022-10-23 08:46:23', 0, NULL, '1', '2022-08-04 16:06:36', 'superadmin', '超管', '2022-09-29 10:53:54', '1544145698858913794', '普通用户', 3);
INSERT INTO `t_top_msg` VALUES ('1555102988791549954', '-1', '在建项目的涉水工程', '截止6月底\n佛山市城市轨道交通工程无涉水工程。', 11, '3', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:07:00', 'superadmin', '超管', '2022-08-08 08:49:49', 'superadmin', '超管', 11);
INSERT INTO `t_top_msg` VALUES ('1555103080671973377', '-1', '重大风险情况', '截止6月底\n全市在建城市轨道交通工程目前在施工的共有8个重大风险（8个Ⅰ级管控和10个Ⅱ级管控），其中盾构Ⅰ级管控5个，深基坑Ⅰ级管控3个。', 12, '3', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-04 16:07:22', 'superadmin', '超管', '2022-08-04 16:09:23', 'superadmin', '超管', 13);
INSERT INTO `t_top_msg` VALUES ('1557262673254649857', '-1', '疫情防控情况', '<p><span class=\"ql-size-large\"><img src=\"/file_service_test/download?attachmentId=1569484242391502849\"/> </span></p><p><span class=\"ql-size-large\">  佛山市在建轨道交通工程（含城市轨道、省管铁路）共11个项目60个在建工地（施工标段），参建人员7062人，当日新进场人员202人，新进场人员都持48小时核酸检测和三天两检证明。7天内重点关注人员省外0人，省内0人。涉疫应急处置五种场景0人。防疫培训，线上0人，线下0人。全部工地均每周开展一次全员核酸检测，重点岗位人员（厨师、保安等）、非集中居住人员每周开展二次核酸检测（间隔3天）。已完成核酸检测人员7062人。全部标段均已按要求自查应急处置人员配备和物资准备情况，全部标段已开展疫情应急处置演练。</span></p><p><span class=\"ql-size-large\"> (数据更新日期：2022年9月29日，更新人：潘玲，审核人：曾幸波) （服务1标负责每天更新一次）</span></p>', 6, '6', '9', '6', 1, '2022-09-30 18:15:53', 0, NULL, '1', '2022-08-10 15:08:49', '1544145698858913794', '普通用户', '2022-09-29 18:15:53', '1544145698858913794', '普通用户', 2);
INSERT INTO `t_top_msg` VALUES ('1557263106547224578', '-1', '全市运营线路基本情况', '  目前我市运营的城市轨道交通线路共5条，分别为地铁广佛线、地铁2号线一期、广州地铁7号线一期西延顺德段、南海区新型公共交通首通段及高明区有轨电车示范线首通段，佛山境内运营里程81.7km（其中地铁65.6km、有轨电车16.1km）。', 2, '6', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-10 15:10:32', '1544145698858913794', '普通用户', '2022-08-15 11:15:13', '1544145698858913794', '普通用户', 4);
INSERT INTO `t_top_msg` VALUES ('1557267358430629889', '-1', '三防工作情况', '（截止8月8日）三防信息：\n  1.全市在建轨道交通工程目前低洼易涝点共14处。佛山市轨道交通三号线9处、佛山市轨道交通四号线1处、二号线2处、南海有轨电车里水示范段和南海区新型公交系统试验段各1处。\n  2.全市轨道交通在建工共453处地板房均已加固，板房居住施工人员2170人，三防期间根据相关要求及时撤离板房居住人员。\n  3.全市轨道交通领域在建工地应急抢险队伍39支，运营单位12支，三防物资起重设备15台、挖掘机15台、装载机4台、发电机29台、水泵255台、运输车辆10辆。\n（服务1标负责每月更新一次）\n<div><br></div>', 7, '6', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-10 15:27:26', '1544145698858913794', '普通用户', '2022-08-18 15:16:54', '1544145698858913794', '普通用户', 5);
INSERT INTO `t_top_msg` VALUES ('1557547065063608321', '-1', '全市轨道交通规划基本情况', '全市规划城市轨道交通线路23条，761公里。', 3, '6', '9', '3', NULL, NULL, 1, NULL, '1', '2022-08-11 09:58:53', '1544145698858913794', '普通用户', NULL, NULL, NULL, 6);
INSERT INTO `t_top_msg` VALUES ('1560162185715486721', '-1', '全市诚信管理情况', '<p style=\"text-align: center;\">  <img src=\"/file_service_test/download?attachmentId=1569495626579808257\" width=\"491\"/></p><p>佛山市城市轨道交通建设行业诚信管理系统累计在册企业数685家，累计登记技术管理人员8378人。其中诚信登记A级:49家，B级：634家，C级：2家（中国建筑第四工程局有限公司、铁四院（湖北）工程监理咨询有限公司），D级：0家。 今年以来截至8月17日，我市轨道交通行业完成225家拟参建企业的诚信登记，对参建单位出具了63宗扣分通知书，累计诚信扣335分；依据管理办法，对参建单位申请的85宗奖励加分登记，累计诚信登记加分341分，对轨道交通工程参建企业实行差异化监管。（数据更新日期：2022年8月18日，更新人：刘攀，审核人：黎富春）</p>', 4, '6', '9', '6', 30, '2022-10-13 09:19:18', 0, NULL, '1', '2022-08-18 15:10:26', '1544145698858913794', '普通用户', '2022-09-29 10:53:54', '1544145698858913794', '普通用户', 8);
INSERT INTO `t_top_msg` VALUES ('1572429310698033153', '-1', '佛山市轨道交通规划总体情况', '<p>  佛山市轨道交通线网是由国家铁路、城际铁路、地铁以及有轨电车四个层次组成。根据《粤港澳大湾区城际铁路规划》以及《佛山市轨道交通系统规划》（2016年市政府常务会议审议通过），佛山市境内的轨道交通包括国家铁路12条（段）、城际铁路7条（段）、地铁14条线路，有轨电车3条。</p><p>  国家铁路佛山境内12条（段），佛山段总里程合计412.251公里。其中已开通广茂铁路、武广铁路客运专线、贵广铁路、南广铁路、广珠铁路、南沙港铁路等6条线路；广湛高铁、珠肇高铁珠三角枢纽机场至江门段、珠肇高铁高明至肇庆东段等3个项目正在建设；深南高铁珠三角枢纽机场至省界段、广州站至广州南站联络线、柳广铁路等3个项目正在开展项目前期工作。</p><p>  城际铁路佛山境内7条（段），佛山段总里程合计287.52公里。其中广珠城际、佛肇城际已开通运营；广佛环线（佛山西站至广州南站段）建设已基本完成，有望近期开通；广佛环线（佛山西站至广州北站段）计划于年内动工；佛山经广州至东莞城际、广佛江珠城际正在开展项目前期研究工作；肇顺南城际尚处于功能定位论证阶段，十四五期间以线站位研究和通道控制为主。</p><p>  佛山城市轨道交通线网规划共有14条线路，总里程约562公里。其中已开通运营有广佛线和2号线一期2条（段）以及广州地铁7号线西延顺德段，运营里程65.7公里；在建项目2个，分别为3号线和4号线一期，建设里程124.72公里；2号线二期、11号线已批复建设规划，正在开展项目工可研究，佛山段总长55.9公里。获批建设规划线路共5条，加上广州7号线西延顺德段合计246.32公里。目前，市自然资源局正在牵头开展佛山市城市轨道交通线网规划修编工作，我市地铁规划总规模将进一步调整。</p><p>  佛山有轨电车规划建设由区主导，目前运营和在建总里程30.7公里。其中高明现代有轨电车示范线、南海有轨电车1号线首通段已开通运营，运营里程16公里；南海有轨电车1号线后通段、里水有轨电车等2个项目正在建设。</p><p>此外，还有在建地方铁路南海一汽大众铁路专用线，约8.9公里。</p>', 7, '6', '9', '3', NULL, NULL, 0, NULL, '1', '2022-09-21 11:35:37', '1544145698858913794', '普通用户', '2022-09-29 10:53:54', '1544145698858913794', '普通用户', 9);
INSERT INTO `t_top_msg` VALUES ('1575317813333168130', '-1', 'APP数据更新责任清单表', '<p><span style=\"color: rgb(230, 0, 0);\">  为保障APP数据信息及时准确性，特制定APP数据更新责任清单表，后期根据使用情况动态调整。</span></p><p><img src=\"/file_service_test/download?attachmentId=1575317774355501057\"/></p>', 8, '6', '9', '3', NULL, NULL, 0, NULL, '1', '2022-09-29 10:53:29', '1544145698858913794', '普通用户', '2022-09-29 11:00:58', '1544145698858913794', '普通用户', 1);
INSERT INTO `t_top_msg_audit` VALUES ('1557547065063608321', '-1', '全市轨道交通规划基本情况', '国家铁路：途经我市的国家铁路项目共12条（段），总里程403.49公里。\n城际铁路：途经我市的城际轨道交通项目7条（段），总里程287.42公里。\n城市轨道：2016年7月，市政府批复《佛山市城市轨道交通线网规划修编》。根据规划成果，我市规划地铁项目共14条，总长度为562公里。市自然资源局正在开展佛山市城市轨道交通线网规划修编工作并已通过专家评审，目前已向书记做专题汇报。根据现阶段规划成果，佛山市规划地铁项目共22条，总里程约761公里（后续将根据实际情况进一步调整优化）。\n有轨电车：根据2016年7月市政府批复《佛山市城市轨道交通线网规划修编》，我市规划有轨电车项目共19条，线网总规模433.3公里。\n\n', 0, '6', '3', '3', NULL, NULL, 1, NULL, '1', '2022-08-11 09:58:53', '1544145698858913794', '普通用户', '2022-09-06 16:49:22', '1544145698858913794', '普通用户', NULL, 8);
